року браузера:\r\n\r\n[user:one-time-login-url] \r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу задания нового пароля. Она действительна в течение суток, и, если по ней не пройти, то ничего не случится.\r\n\r\n-- Команда сайта «[site:name]»\";s:7:\"subject\";s:126:\"Изменение данных для входа пользователя [user:display-name] на сайте «[site:name]»\";}s:22:\"register_admin_created\";a:2:{s:4:\"body\";s:762:\"[user:display-name],\r\n\r\nАдминистратор сайта «[site:name]» создал для вас учётную запись. Вы можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url]\r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу задания своего пароля.\r\n\r\nПосле установки пароля войти на сайт можно на странице [site:login-url], введя:\r\n\r\nИмя пользователя: [user:name]\r\nПароль: ваш пароль \r\n\r\n-- Команда сайта «[site:name]»\";s:7:\"subject\";s:108:\"Администратор сайта «[site:name]» создал для вас учётную запись\";}s:29:\"register_no_approval_required\";a:2:{s:4:\"body\";s:728:\"[user:display-name],\r\n\r\nБлагодарим вас за регистрацию на сайте «[site:name]». Можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url] \r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу установки пароля.\r\n\r\nПосле установки пароля войти на сайт можно на странице [site:login-url], введя:\r\n\r\nИмя пользователя: [user:name]\r\nПароль: ваш пароль \r\n\r\n-- Команда сайта «[site:name]»\";s:7:\"subject\";s:113:\"Детали учётной записи пользователя [user:display-name] на сайте [site:name]\";}s:25:\"register_pending_approval\";a:2:{s:4:\"body\";s:519:\"[user:display-name],\r\n\r\nБлагодарим вас за регистрацию на сайте «[site:name]». В настоящее время ваша заявка ожидает одобрения администратором. Когда она будет принята, Вы получите другое письмо, в котором будет указано, как войти и установить пароль, а также  прочие детали. \r\n\r\n-- Команда сайта «[site:name]»\";s:7:\"subject\";s:159:\"Детали учётной записи [user:display-name] на сайте «[site:name]» (ожидает одобрения администратором)\";}s:31:\"register_pending_approval_admin\";a:2:{s:4:\"body\";s:115:\"[user:display-name] подал заявку на получение учётной записи.\r\n\r\n[user:edit-url]\";s:7:\"subject\";s:159:\"Детали учётной записи [user:display-name] на сайте «[site:name]» (ожидает одобрения администратором)\";}s:16:\"status_activated\";a:2:{s:4:\"body\";s:763:\"[user:display-name],\r\n\r\nВаша учётная запись на сайте «[site:name]» активирована.\r\n\r\nТеперь Вы можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url] \r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу установки пароля.\r\n\r\nПосле установки пароля войти на сайт можно на странице [site:login-url], введя:\r\n\r\nИмя пользователя: [user:account-name]\r\nПароль: ваш пароль \r\n\r\n-- Команда сайта «[site:name]»\";s:7:\"subject\";s:111:\"Детали учётной записи [user:display-name] на сайте «[site:name]» (одобрено)\";}s:14:\"status_blocked\";a:2:{s:4:\"body\";s:170:\"[user:display-name],\r\n\r\nВаша учётная запись на сайте [site:name] была заблокирована.\r\n\r\n--  Команда сайта [site:name]\";s:7:\"subject\";s:140:\"Детали учётной записи пользователя [user:display-name] на сайте [site:name] (заблокирован)\";}s:15:\"status_canceled\";a:2:{s:4:\"body\";s:156:\"[user:display-name],\r\n\r\nВаша учётная запись на сайте «[site:name]» удалена.\r\n\r\n-- Команда сайта «[site:name]»\";s:7:\"subject\";s:109:\"Детали учётной записи [user:display-name] на сайте «[site:name]» (удалено)\";}s:8:\"langcode\";s:2:\"ru\";s:5:\"_core\";a:1:{s:19:\"default_config_hash\";s:43:\"m4J3ROov32OEquRYGLbx3SpdDGuqx9l_zJtNvihqdCg\";}}',-1,1531238855.056,1,'','0'),('user.role.anonymous','a:10:{s:4:\"uuid\";s:36:\"f802287d-a554-4dc5-be19-794932ef010d\";s:8:\"langcode\";s:2:\"ru\";s:6:\"status\";b:1;s