e page by the language detection settings either for Content or User interface).','','none'),(6730,'Because each result row contains a specific translation of each entity, field-level filters are also relative to these entity translations. For example, if your view has a filter that specifies that the entity title should contain a particular English word, you will presumably filter out all rows containing Chinese translations, since they will not contain the English word. If your view also has a second filter specifying that the title should contain a particular Chinese word, and if you are using \"And\" logic for filtering, you will presumably end up with no results in the view, because there are probably not any entity translations containing both the English and Chinese words in the title.','','none'),(6731,'Independent of filtering, you can choose the display language (the language used to display the entities and their fields) via a setting on the display. Your language choices are the same as the filter language choices, with an additional choice of \"Content language of view row\" and \"Original language of content in view row\", which means to display each entity in the result row using the language that entity has or in which it was originally created. In theory, this would give you the flexibility to filter to French translations, for instance, and then display the results in Spanish. The more usual choices would be to use the same language choices for the display language and each entity filter in the view, or to use the Row language setting for the display.','','none'),(6732,'Entity link','','none'),(6733,'Entity delete link','','none'),(6734,'Entity edit link','','none'),(6735,'Link to @entity_type_label','','none'),(6736,'Link to edit @entity_type_label','','none'),(6737,'Provide an edit link to the @entity_type_label.','','none'),(6738,'Link to delete @entity_type_label','','none'),(6739,'Provide a delete link to the @entity_type_label.','','none'),(6