automatically as available on the <a href=\":actions\">Actions page</a>.','','none'),(6947,'<em>Advanced actions</em> are user-created and have to be configured individually. Create an advanced action on the <a href=\":actions\">Actions page</a> by selecting an action type from the drop-down list. Then configure your action, for example by specifying the recipient of an automated email message.','','none'),(6948,'The message that should be sent. You may include placeholders like [node:title], [user:account-name], [user:display-name] and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(6949,'The message to be displayed to the current user. You may include placeholders like [node:title], [user:account-name], [user:display-name] and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(6950,'The Aggregator module is an on-site syndicator and news reader that gathers and displays fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines in feeds, using a number of standardized XML-based formats. For more information, see the <a href=\":aggregator-module\">online documentation for the Aggregator module</a>.','','none'),(6951,'Users view feed content in the <a href=\":aggregator\">main aggregator display</a>, or by <a href=\":aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed can be displayed as a block through the <a href=\":admin-block\">Blocks administration page</a>.','','none'),(6952,'Configuring the display of feed items','','none'),(6953,'Discarding old feed items','','none'),(6954,'A <a href=\":aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\":import-opml\">imported via an OPML file</a>.','','none'),(6955,'A working <a href=\":cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(6956,'Current feeds are listed below, and <a href=\":addfeed\">new feeds may be added</a>. For each feed, the <em>latest items</em> block may be enabled at the <a href=\":block\">blocks administration page</a>.','','none'),(6957,'@title feed','','none'),(6958,'No feeds available. <a href=\":link\">Add feed</a>.','','none'),(6959,'The parent website\'s description that comes from the @description element in the feed.','','none'),(6960,'The length of time between feed updates. Requires a correctly configured <a href=\":cron\">cron maintenance task</a>.','','none'),(6961,'Requires a correctly configured <a href=\":cron\">cron maintenance task</a>.','','none'),(6962,'The Ban module allows administrators to ban visits to their site from individual IP addresses. For more information, see the <a href=\":url\">online documentation for the Ban module</a>.','','none'),(6963,'Administrators can enter IP addresses to ban on the <a href=\":bans\">IP address bans</a> page.','','none'),(6964,'The HTTP Basic Authentication module supplies an <a href=\"http://en.wikipedia.org/wiki/Basic_access_authentication\">HTTP Basic authentication</a> provider for web service requests. This authentication provider authenticates requests using the HTTP Basic Authentication username and password, as an alternative to using Drupal\'s standard cookie-based authentication system. It is only useful if your site provides web services configured to use this type of authentication (for instance, the <a href=\":rest_help\">RESTful Web Services module</a>). For more information, see the <a href=\":hba_do\">online documentation for the HTTP Basic Authentication module</a>.','','none'),(6965,'The Block module allows you to place blocks in regions of your installed themes, and configure block settings. For more information, see the <a href=\":blocks-documentation\">online documentation for the Block module</a>.','','none'),(6966,'You can see where the regions are for the current theme by clicking the <em>Demonstrate block regions</em> link on the <a href=\":blocks\">Block layout page</a>. Regions are specific to each theme.','','none'),(6967,'To change the settings of an individual block click on the <em>Configure</em> link on the <a href=\":blocks\">Block layout page</a>. The available options vary depending on the module that provides the block. For all blocks you can change the block title and toggle whether to display it.','','none'),(6968,'You can add custom blocks, if the <em>Custom Block</em> module is installed. For more information, see the <a href=\":blockcontent-help\">Custom Block help page</a>.','','none'),(6969,'Block settings updated.','','none'),(6970,'Edit %label custom block type','','none'),(6971,'You have not created any block types yet. Go to the <a href=\":url\">block type creation page</a> to add a new block type.','','none'),(6972,'Block with uuid %uuid does not exist. <a href=\":url\">Add custom block</a>.','','none'),(6973,'Add a <a href=\":url\">custom block</a>.','','none'),(6974,'The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. Enabling the module creates a new content type <em>Book page</em>. For more information, see the <a href=\":book\">online documentation for the Book module</a>.','','none'),(6975,'You can assign separate permissions for <em>creating new books</em> as well as <em>creating</em>, <em>editing</em> and <em>deleting</em> book content. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\":admin-book\">Book list page</a>.','','none'),(6976,'The <em>Book page</em> content type is the initial content type enabled for book outlines. On the <a href=\":admin-settings\">Book settings page</a> you can configure content types that can used in book outlines.','','none'),(6977,'Users with the <em>Add content and child pages to books</em> permission will see a link to <em>Add child page</em> when viewing a content item that is part of a book outline. This link will allow users to create a new content item of the content type you select on the <a href=\":admin-settings\">Book settings page</a>. By default this is the <em>Book page</em> content type.','','none'),(6978,'Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\':admin-block\'>Blocks layout page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(6979,'The outline feature allows you to include pages in the <a href=\":book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\":book-admin\">reorder an entire book</a>.','','none'),(6980,'The parent page in the book. The maximum depth for a book and all child pages is @maxdepth. Some pages in the selected book may not be available as parents if selecting them would exceed this limit.','','none'),(6981,'The Breakpoint module keeps track of the height, width, and resolution breakpoints where a responsive design needs to change in order to respond to different devices being used to view the site. This module does not have a user interface. For more information, see the <a href=\":docs\">online documentation for the Breakpoint module</a>.','','none'),(6982,'<a href=\":w3\">Media  queries</a> are a formal way to encode breakpoints. For instance, a width breakpoint at 40em would be written as the media query \"(min-width: 40em)\". Breakpoints are really just media queries with some additional meta-data, such as a name and multiplier information.','','none'),(6983,'The CKEditor module provides a highly-accessible, highly-usable visual text editor and adds a toolbar to text fields. Users can use buttons to format content and to create semantically correct and valid HTML. The CKEditor module uses the framework provided by the <a href=\":text_editor\">Text Editor module</a>. It requires JavaScript to be enabled in the browser. For more information, see the <a href=\":doc_url\">online documentation for the CKEditor module</a> and the <a href=\":cke_url\">CKEditor website</a>.','','none'),(6984,'CKEditor has to be enabled and configured separately for individual text formats from the <a href=\":formats\">Text formats and editors page</a> because the filter settings for each text format can be different. For more information, see the <a href=\":text_editor\">Text Editor help page</a> and <a href=\":filter\">Filter help page</a>.','','none'),(6985,'CKEditor only allow users to format content in accordance with the filter configuration of the specific text format. If a text format excludes certain HTML tags, the corresponding toolbar buttons are not displayed to users when they edit a text field in this format. For more information see the <a href=\":filter\">Filter help page</a>.','','none'),(6986,'The built in WYSIWYG editor (CKEditor) comes with a number of <a href=\":features\">accessibility features</a>. CKEditor comes with built in <a href=\":shortcuts\">keyboard shortcuts</a>, which can be beneficial for both power users and keyboard only users.','','none'),(6987,'The Color module allows users with the <em>Administer site configuration</em> permission to change the color scheme (color of links, backgrounds, text, and other theme elements) of compatible themes. For more information, see the <a href=\":color_do\">online documentation for the Color module</a>.','','none'),(6988,'The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the <a href=\":comment\">online documentation for the Comment module</a>.','','none'),(6989,'Enabling commenting','','none'),(6990,'Configuring commenting settings','','none'),(6991,'Commenting settings can be configured by editing the <em>Comments</em> field on the <em>Manage fields page</em> of an entity type if the <em>Field UI module</em> is enabled. Configuration includes the label of the comments field, the number of comments to be displayed, and whether they are shown in threaded list. Commenting can be be configured as: <em>Open</em> to allow new comments, <em>Closed</em> to view existing comments, but prevent new comments, or <em>Hidden</em> to hide existing comments and prevent new comments. Changing this configuration for an entity type will not change existing entity items.','','none'),(6992,'Users with the appropriate permissions can override the default commenting settings of an entity type when they create an item of that type.','','none'),(6993,'Comments from users who have the <em>Skip comment approval</em> permission are published immediately. All other comments are placed in the <a href=\":comment-approval\">Unapproved comments</a> queue, until a user who has permission to <em>Administer comments and comment settings</em> publishes or deletes them. Published comments can be bulk managed on the <a href=\":admin-comment\">Published comments</a> administration page. When a comment has no replies, it remains editable by its author, as long as the author has <em>Edit own comments</em> permission.','','none'),(6994,'In reply to @parent_title by @parent_username','','none'),(6995,'Name for @anonymous','','none'),(6996,'<a href=\":login\">Log in</a> or <a href=\":register\">register</a> to post comments','','none'),(6997,'<a href=\":login\">Log in</a> to post comments','','none'),(6998,'Select the Comment type to use for this comment field. Manage the comment types from the <a href=\":url\">administration overview page</a>.','','none'),(6999,'The Configuration Manager module provides a user interface for importing and exporting configuration changes between installations of your website in different environments. Configuration is stored in YAML format. For more information, see the <a href=\":url\">online documentation for the Configuration Manager module</a>.','','none'),(7000,'You can create and download an archive consisting of all your site\'s configuration exported as <em>*.yml</em> files on the <a href=\":url\">Export</a> page.','','none'),(7001,'You can upload a full site configuration from an archive file on the <a href=\":url\">Import</a> page. When importing data from a different environment, the site and import files must have matching configuration values for UUID in the <em>system.site</em> configuration item. That means that your other environments should initially be set up as clones of the target site. Migrations are not supported.','','none'),(7002,'You can review differences between the active configuration and an imported configuration archive on the <a href=\":synchronize\">Synchronize</a> page to ensure that the changes are as expected, before finalizing the import. The Synchronize page also shows configuration items that would be added or removed.','','none'),(7003,'You can import a single configuration item by pasting it in YAML format into the form on the <a href=\":single-import\">Single import</a> page.','','none'),(7004,'Export and download the full configuration of this site as a gzipped tar file.','','none'),(7005,'Choose a configuration item to display its YAML structure.','','none'),(7006,'Import a single configuration item by pasting its YAML structure into the text field.','','none'),(7007,'Full archive','','none'),(7008,'Single item','','none'),(7009,'Staged','','none'),(7010,'The following items in your active configuration have changes since the last import that may be lost on the next import.','','none'),(7011,'@collection configuration collection','','none'),(7012,'@source_name to @target_name','','none'),(7013,'In order to translate configuration, the website must have at least two <a href=\":url\">languages</a>.','','none'),(7014,'Users with the <em>Translate user edited configuration</em> permission can access the configuration translation overview, and manage translations for specific languages. The <a href=\":translation-page\">Configuration translation</a> page shows a list of all configuration text that can be translated, either as individual items or as lists. After you click on <em>Translate</em>, you are provided with a list of all languages. You can <em>add</em> or <em>edit</em> a translation for a specific language. Users with specific configuration permissions can also <em>edit</em> the text for the site\'s default language. For some configuration text items (for example for the site information), the specific translation pages can also be accessed directly from their configuration pages.','','none'),(7015,'You can choose to translate date formats on the <a href=\":translation-page\">Configuration translation</a> page. This allows you not only to translate the label text, but also to set a language-specific <em>PHP date format</em>.','','none'),(7016,'@label <span class=\"visually-hidden\">(@source_language)</span>','','none'),(7017,'The Contact module allows visitors to contact registered users on your site, using the personal contact form, and also allows you to set up site-wide contact forms. For more information, see the <a href=\":contact\">online documentation for the Contact module</a>.','','none'),(7018,'[@form] @subject','','none'),(7019,'@sender-name (@sender-url) sent a message using the contact form at @form-url.','','none'),(7020,'[@site-name] @subject','','none'),(7021,'Hello @recipient-name,','','none'),(7022,'@sender-name (@sender-url) has sent you a message via your contact form at @site-name.','','none'),(7023,'If you don\'t want to receive such emails, you can change your settings at @recipient-edit-url.','','none'),(7024,'@name (not verified)','','none'),(7025,'The contact form has not been configured. <a href=\":add\">Add one or more forms</a> .','','none'),(7026,'The Content Translation module allows you to translate content, comments, custom blocks, taxonomy terms, users and other <a href=\":field_help\" title=\"Field module help, with background on content entities\">content entities</a>. Together with the modules <a href=\":language\">Language</a>, <a href=\":config-trans\">Configuration Translation</a>, and <a href=\":locale\">Interface Translation</a>, it allows you to build multilingual websites. For more information, see the <a href=\":translation-entity\">online documentation for the Content Translation module</a>.','','none'),(7027,'Before you can translate content, there must be at least two languages added on the <a href=\":url\">languages administration</a> page.','','none'),(7028,'To configure translation for this field, <a href=\":language-settings-url\">enable language support</a> for this type.','','none'),(7029,'<a href=\":settings_url\">Enable translation</a> for <em>content types</em>, <em>taxonomy vocabularies</em>, <em>accounts</em>, or any other element you wish to translate.','','none'),(7030,'Hovering over the area of interest will temporarily make the contextual links button visible (which looks like a pencil in most themes, and is normally displayed in the upper right corner of the area). The icon typically looks like this: @picture','','none'),(7031,'If you have the <a href=\":toolbar\">Toolbar module</a> enabled, clicking the contextual links button in the toolbar (which looks like a pencil) will make all contextual links buttons on the page visible. Clicking this button again will toggle them to invisible.','','none'),(7032,'The <em>settings</em> and the <em>display</em> of the Date field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7033,'Date part order: @order','','none'),(7034,'Time type: @time_type','','none'),(7035,'Time increments: @increment','','none'),(7036,'The Database Logging module logs system events in the Drupal database. For more information, see the <a href=\":dblog\">online documentation for the Database Logging module</a>.','','none'),(7037,'In case of errors or problems with the site, the <a href=\":dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.','','none'),(7038,'The maximum number of messages to keep in the database log. Requires a <a href=\":cron\">cron maintenance task</a>.','','none'),(7039,'Pages which are suitable for caching are cached the first time they are requested, then the cached version is served for all later requests. Dynamic content is handled automatically so that both cache correctness and hit ratio is maintained.','','none'),(7040,'Internal Dynamic Page Cache','','none'),(7041,'Caches pages for any user, handling dynamic content correctly.','','none'),(7042,'No eligible views were found. <a href=\":create\">Create a view</a> with an <em>Entity Reference</em> display, or add such a display to an <a href=\":existing\">existing view</a>.','','none'),(7043,'There are no fields yet added. You can add new fields on the <a href=\":link\">Manage fields</a> page.','','none'),(7044,'The %display_mode mode now uses custom display settings. You might want to <a href=\":url\">configure them</a>.','','none'),(7045,'@size limit.','','none'),(7046,'file from @field_name','','none'),(7047,'The File module allows you to create fields that contain files. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":file_documentation\">online documentation for the File module</a>.','','none'),(7048,'The <em>settings</em> and the <em>display</em> of the file field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(7049,'Uploaded files can either be stored as <em>public</em> or <em>private</em>, depending on the <a href=\":file-system\">File system settings</a>. For more information, see the <a href=\":system-help\">System module help page</a>.','','none'),(7050,'The file used in the @name field may not be referenced.','','none'),(7051,'The file referenced by the @name field does not exist.','','none'),(7052,'Use the <a href=\":url\">@label</a> text format','','none'),(7053,'For more information see W3C\'s <a href=\":html-specifications\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.','','none'),(7054,'If you do encounter problems, try using HTML character entities. A common example looks like &amp;amp; for an ampersand &amp; character. For a full list of entities see HTML\'s <a href=\":html-entities\">entities</a> page. Some of the available characters include:','','none'),(7055,'Limit allowed HTML tags and correct faulty HTML','','none'),(7056,'The Forum module adds and uses a content type called <em>Forum topic</em>. For background information on content types, see the <a href=\":node_help\">Node module help page</a>.','','none'),(7057,'For more information, see the <a href=\":forum\">online documentation for the Forum module</a>.','','none'),(7058,'Visit the <a href=\":forums\">Forums page</a> to set up containers and forums to hold your discussion topics.','','none'),(7059,'The <a href=\":create-topic\">Forum topic</a> link on the <a href=\":content-add\">Add content</a> page creates the first post of a new threaded discussion, or thread.','','none'),(7060,'Adjust the display of your forum topics. Organize the forums on the <a href=\":forum-structure\">forum structure page</a>.','','none'),(7061,'To uninstall Forum, first delete all <a href=\":url\">%vocabulary</a> terms','','none'),(7062,'No containers or forums available. <a href=\":container\">Add container</a> or <a href=\":forum\">Add forum</a>.','','none'),(7063,'<a href=\":hal_spec\">Hypertext Application Language (HAL)</a> is a format that supports the linking required for hypermedia APIs.','','none'),(7064,'This module adds support for serializing entities (such as content items, taxonomy terms, etc.) to the JSON version of HAL. For more information, see the <a href=\":hal_do\">online documentation for the HAL module</a>.','','none'),(7065,'<strong>Configure your website</strong> Once logged in, visit the <a href=\":admin\">Administration page</a>, where you may <a href=\":config\">customize and configure</a> all aspects of your website.','','none'),(7066,'<strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\":themes\">Appearance page</a>. You may choose from one of the included themes or download additional themes from the <a href=\":download_themes\">Drupal.org themes page</a>.','','none'),(7067,'<strong>Start posting content</strong> Finally, you may <a href=\":content\">add new content</a> to your website.','','none'),(7068,'The History module keeps track of which content a user has read. It marks content as <em>new</em> or <em>updated</em> depending on the last time the user viewed it. History records that are older than one month are removed during cron, which means that content older than one month is always considered <em>read</em>. The History module does not have a user interface but it provides a filter to <a href=\":views-help\">Views</a> to show new or updated content. For more information, see the <a href=\":url\">online documentation for the History module</a>.','','none'),(7069,'image from @field_name','','none'),(7070,'There are currently no styles. <a href=\":url\">Add a new one</a>.','','none'),(7071,'The primary identifier for an image style.','','none'),(7072,'The style machine name.','','none'),(7073,'The style administrative name.','','none'),(7074,'Reorder the configured languages to set their order in the language switcher block and, when editing content, in the list of selectable languages. This ordering does not impact <a href=\":detection\">detection and selection</a>.','','none'),(7075,'The site default language can also be set. It is not recommended to change the default language on a working site. <a href=\":language-detection\">Configure the Selected language</a> setting on the detection and selection page to change the fallback language for language selection.','','none'),(7076,'Browsers use different language codes to refer to the same languages. Internally, a best effort is made to determine the correct language based on the code that the browser sends. You can add and edit additional mappings from browser language codes to <a href=\":configure-languages\">site languages</a>.','','none'),(7077,'Changing the selected language here (and leaving this option as the last among the detection and selection options) is the easiest way to change the fallback language for the website, if you need to change how your site works by default (e.g., when using an empty path prefix or using the default domain). <a href=\":admin-change-language\">Changing the site\'s default language</a> itself might have other undesired side effects.','','none'),(7078,'Explanation of the language options is found on the <a href=\":languages_list_page\">languages list page</a>.','','none'),(7079,'Site\'s default language (@language)','','none'),(7080,'Use language codes as <a href=\":w3ctags\">defined by the W3C</a> for interoperability. <em>Examples: \"en\", \"en-gb\" and \"zh-hant\".</em>','','none'),(7081,'One translation file could not be checked. <a href=\":url\">See the log</a> for details.@count translation files could not be checked. <a href=\":url\">See the log</a> for details.','','none'),(7082,'One translation file could not be imported. <a href=\":url\">See the log</a> for details.@count translation files could not be imported. <a href=\":url\">See the log</a> for details.','','none'),(7083,'One translation string was skipped because of disallowed or malformed HTML. <a href=\":url\">See the log</a> for details.@count translation strings were skipped because of disallowed or malformed HTML. <a href=\":url\">See the log</a> for details.','','none'),(7084,'Translation files with translated interface text are imported automatically when languages are added on the <a href=\":languages\">Languages</a> page, or when modules or themes are enabled. On the <a href=\":locale-settings\">Interface translation settings</a> page, the <em>Translation source</em> can be restricted to local files only, or to include the <a href=\":server\">Drupal translation server</a>. Although modules and themes may not be fully translated in all languages, new translations become available frequently. You can specify whether and how often to check for translation file updates and whether to overwrite existing translations on the <a href=\":locale-settings\">Interface translation settings</a> page. You can also manually import a translation file on the <a href=\":import\">Interface translation import</a> page.','','none'),(7085,'Interface translations are automatically imported when a language is added, or when new modules or themes are enabled. The report <a href=\":update\">Available translation updates</a> shows the status. Interface text can be customized in the <a href=\":translate\">user interface translation</a> page.','','none'),(7086,'This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: Because translation tasks involve many strings, it may be more convenient to <a title=\"User interface translation export\" href=\":export\">export</a> strings for offline editing in a desktop Gettext translation editor.) Searches may be limited to strings in a specific language.','','none'),(7087,'Updates available for: @languages. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(7088,'Missing translations for: @languages. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(7089,'No translation status is available. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(7090,'Interface translation settings','','none'),(7091,'Interface translation import','','none'),(7092,'Interface translation export','','none'),(7093,'Select how frequently you want to check for new interface translations for your currently installed modules and themes. <a href=\":url\">Check updates now</a>.','','none'),(7094,'Translation files are stored locally in the  %path directory. You can change this directory on the <a href=\":url\">File system</a> configuration page.','','none'),(7095,'No translatable languages available. <a href=\":add_language\">Add a language</a> first.','','none'),(7096,'No translation status available. <a href=\":check\">Check manually</a>.','','none'),(7097,'You can enable the newly-created block for this menu on the <a href=\":blocks\">Block layout page</a>.','','none'),(7098,'Each menu has a corresponding block that is managed on the <a href=\":blocks\">Block layout page</a>.','','none'),(7099,'There are no menu links yet. <a href=\":url\">Add link</a>.','','none'),(7100,'The Migrate module provides a framework for migrating data, usually from an external source into your site. It does not provide a user interface. For more information, see the <a href=\":migrate\">online documentation for the Migrate module</a>.','','none'),(7101,'Migration failed with source plugin exception: @e','','none'),(7102,'Memory usage is @usage (@pct% of limit @limit), reclaiming memory.','','none'),(7103,'Memory usage is now @usage (@pct% of limit @limit), not enough reclaimed, starting new batch','','none'),(7104,'Memory usage is now @usage (@pct% of limit @limit), reclaimed enough, continuing','','none'),(7105,'The Migrate Drupal module provides a framework based on the <a href=\":migrate\">Migrate module</a> to facilitate migration from a Drupal (6, 7, or 8) site to your website. It does not provide a user interface. For more information, see the <a href=\":migrate_drupal\">online documentation for the Migrate Drupal module</a>.','','none'),(7106,'The content access permissions need to be rebuilt. <a href=\":node_access_rebuild\">Rebuild permissions</a>.','','none'),(7107,'The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\":field\">Field module</a>). For more information, see the <a href=\":node\">online documentation for the Node module</a>.','','none'),(7108,'If the site is experiencing problems with permissions to content, you may have to rebuild the permissions cache. Rebuilding will remove all privileges to content and replace them with permissions based on the current modules and settings. Rebuilding may take some time if there is a lot of content or complex permission settings. After rebuilding has completed, content will automatically use the new permissions. <a href=\":rebuild\">Rebuild permissions</a>','','none'),(7109,'This text will be displayed on the <em>Add new content</em> page.','','none'),(7110,'No content types available. <a href=\":link\">Add content type</a>.','','none'),(7111,'Node from URL','','none'),(7112,'The Options module allows you to create fields where data values are selected from a fixed list of options. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":options_do\">online documentation for the Options module</a>.','','none'),(7113,'The Internal Page Cache module caches pages for anonymous users in the database. For more information, see the <a href=\":pagecache-documentation\">online documentation for the Internal Page Cache module</a>.','','none'),(7114,'The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\":pathauto\">Pathauto</a>. For more information, see the <a href=\":path\">online documentation for the Path module</a>.','','none'),(7115,'No URL aliases available. <a href=\":link\">Add URL alias</a>.','','none'),(7116,'The internal system path.','','none'),(7117,'The path alias.','','none'),(7118,'The Responsive Image module provides an image formatter that allows browsers to select which image file to display based on media queries or which image file types the browser supports, using the HTML 5 picture and source elements and/or the sizes, srcset and type attributes. For more information, see the <a href=\":responsive_image\">online documentation for the Responsive Image module</a>.','','none'),(7119,'By creating responsive image styles you define which options the browser has in selecting which image file to display. In most cases this means providing different image sizes based on the viewport size. On the <a href=\":responsive_image_style\">Responsive image styles</a> page, click <em>Add responsive image style</em> to create a new style. First choose a label, a fallback image style and a breakpoint group and click Save.','','none'),(7120,'See the <a href=\":responsive_image_help\">Responsive Image help page</a> for information on the sizes attribute.','','none'),(7121,'Configure Responsive Image Styles','','none'),(7122,'Some search page plugins, such as the core Content search page, index searchable text using the Drupal core search index, and will not work unless content is indexed. Indexing is done during <em>cron</em> runs, so it requires a <a href=\":cron\">cron maintenance task</a> to be set up. There are also several settings affecting indexing that can be configured on the <a href=\":search-settings\">Search pages page</a>: the number of items to index per cron run, the minimum word length to index, and how to handle Chinese, Japanese, and Korean characters.','','none'),(7123,'… @excerpt … @excerpt …','','none'),(7124,'This module does not have a user interface. It is used by other modules which need to serialize data, such as <a href=\":rest\">REST</a>.','','none'),(7125,'For more information, see the <a href=\":doc_url\">online documentation for the Serialization module</a>.','','none'),(7126,'Define which shortcut set you are using on the <a href=\":shortcut-link\">Shortcuts tab</a> of your account page.','','none'),(7127,'No shortcuts available. <a href=\":link\">Add a shortcut</a>','','none'),(7128,'You are now using the new %set_name shortcut set. You can edit it from this page or <a href=\":switch-url\">switch back to a different one.</a>','','none'),(7129,'The menu.mlid primary key for this 