re information.','','none'),(7205,'Update Manager settings','','none'),(7206,'Check for updates of uninstalled modules and themes','','none'),(7207,'You can find <a href=\":module_url\">modules</a> and <a href=\":theme_url\">themes</a> on <a href=\":drupal_org_url\">drupal.org</a>. The following file extensions are supported: %extensions.','','none'),(7208,'Back up your database and site before you continue. <a href=\":backup_url\">Learn how</a>.','','none'),(7209,'Deprecated: User Name','','none'),(7210,'Deprecated: Use account-name or display-name instead.','','none'),(7211,'The display name of the user account.','','none'),(7212,'The User module allows users to register, log in, and log out. It also allows users with proper permissions to manage user roles and permissions. For more information, see the <a href=\":user_docs\">online documentation for the User module</a>.','','none'),(7213,'Through the <a href=\":people\">People administration page</a> you can add and cancel user accounts and assign users to roles. By editing one particular user you can change their username, email address, password, and information in other fields.','','none'),(7214,'<em>Roles</em> are used to group and classify users; each user can be assigned one or more roles. Typically there are two pre-defined roles: <em>Anonymous user</em> (users that are not logged in), and <em>Authenticated user</em> (users that are registered and logged in). Depending on how your site was set up, an <em>Administrator</em> role may also be available: users with this role will automatically be assigned any new permissions whenever a module is enabled. You can create additional roles on the <a href=\":roles\">Roles administration page</a>.','','none'),(7215,'Because User accounts are an entity type, you can extend them by adding fields through the Manage fields tab on the <a href=\":accounts\">Account settings page</a>. By adding fields for e.g., a picture, a biography, or address, you can a create a custom profile for the users of the website. For background information on entities and fields, see the <a href=\":field_help\">Field module help page</a>.','','none'),(7216,'Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\":role\">Roles</a> page to create a role.) Any permissions granted to the Authenticated user role will be given to any user who is logged in to your site. From the <a href=\":settings\">Account settings</a> page, you can make any role into an Administrator role for the site, meaning that role will be granted all new permissions automatically. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','none'),(7217,'A role defines a group of users that have certain privileges. These privileges are defined on the <a href=\":permissions\">Permissions page</a>. Here, you can define the names and the display sort order of the roles on your site. It is recommended to order roles from least permissive (for example, Anonymous user) to most permissive (for example, Administrator user). Users who are not logged in have the Anonymous user role. Users who are logged in have the Authenticated user role, plus any other roles granted to their user account.','','none'),(7218,'Make it at least 12 characters','','8.5.4'),(7219,'Manage all user accounts. This includes editing all user information, changes of email addresses and passwords, issuing emails to users and blocking and deleting user accounts.','','none'),(7220,'Required if you want to change the %mail or %pass below. <a href=\":request_new_url\" title=\"Send password reset instructions via email.\">Reset your password</a>.','','none'),(7221,'Users with the %select-cancel-method or %administer-users <a href=\":permissions-url\">permissions</a> can override this default method.','','none'),(7222,'Available variables are: [site:name], [site:url], [user:display-na