жетов:','ru',0),(6534,'Предоставлено ядром Drupal','ru',0),(6535,'Назначение стилей изображений','ru',0),(6536,'Именование стилей изображений','ru',0),(6537,'Когда вы определяете стиль изображения, вам необходимо выбрать отображаемое имя и машинное имя. Отображаемое имя выводится на административных страницах, машинное имя используется в создании URL изображения, обработанного этим стилем. Существует два подхода именования стиля изображения: базирующийся на эффектах, которые применяются (например,  <em>Размер 85x85</em>) или базирующийся на том, где вы планируете его использовать (например, <em>Изображение профиля</em>).','ru',0),(6538,'Настройка стилей изображений','ru',0),(6539,'Некоторые настройки полей изображений устанавливаются один раз при создании поля и их невозможно изменить в дальнейшем. Сюда входят: выбор общедоступного или личного хранилища файлов и количество изображений, сохраняемых в поле. Остальные настройки можно изменить в дальнейшем; к ним относятся: метка поля, текст справки, разрешённые расширения файлов, ограничение разрешения изображений и подкаталог в общедоступном или частном хранилище файлов, где будут храниться изображения. Редактируемые настройки также могут иметь разные значения для различных подтипов сущностей. Например, если поле изображения используется в типах материалов Страница и Статья, то можно хранить файлы для этих двух типов материалов в разных подкаталогах.','ru',0),(6540,'Настройка отображения и отображения формы','ru',0),(6541,'Конфигурация выбранного языка','ru',0),(6542,'Выбранный язык по умолчанию больше не существует.','ru',0),(6543,'Настройки определения языка были сохранены.','ru',0),(6544,'Языковые коды или другой текст для использования в качестве префикса пути для определения языка через URL. Для выбора  языка по умолчанию это поле должно быть оставлено пустым. <strong>Модификация этого поля может разрушить существующие URL\'ы. Используйте с осторожностью на рабочих серверах.</strong> Пример: определяем \"deutsch\