ы; если вы фильтруете по языку, появится не более одного результата (это может быть нулевой результат, если конкретные сущности не имеют перевода, совпадающего с вашим фильтром). Если представление использует отношения, каждая сущность в отношении будет отфильтрована отдельно. Вы можете фильтровать представление по конкретному языку, например \"Английский\" или \"Испанский\", или по языку отображаемой страницы (язык, который был выбран для страницы в настройках определения языка для Содержимого или Пользовательского интерфейса).','ru',0),(6730,'Поскольку каждая строка результата содержит определенный перевод каждой из сущностей, фильтры уровня полей также влияют на переводы этих сущностей. Например, если ваше представление имеет фильтр, который определяет, что заголовок сущности должна содержать определенное английское слово, очевидно, что будут отбрасываться все строки с китайским переводом, поскольку они точно не содержат английских слов. Если представление также содержит второй фильтр, который определяет, что заголовок должен содержать определенное китайское слово, и если вы используете для фильтрации логический оператор \"И\", очевидно это представление также не предоставит результатов, поскольку скорее всего не будет таких переводов сущностей, где одновременно в заголовке содержатся английские и китайские слова.','ru',0),(6731,'Независимо от фильтрации можно выбрать язык отображения (язык, используемый для показа сущностей и их полей) из настройки отображения. Варианты языка такие же, как и в фильтрах, с дополнительным выбором  \"Язык содержимого из строки представления\" или \"Оригинальный язык содержимого из строки представления\", которое означает отображение каждой из сущностей в строке результатов в языке, на  котором написана сущность, или на котором она была изначально создана. Теоретически это добавит гибкости в фильтрации, например, французских переводов, и затем отображении результатов в испанском языке. Лучшим способом было бы использовать те же варианты языка, для отображения языка и фильтра каждой сущности в представлении, или использовать для показа настройку языка строки.','ru',0),(6732,'Ссылка сущности','ru',0),(6733,'Ссылка удаления сущности','ru',0),(6734,'Ссылка редактирования сущности','ru',0),(6735,'Ссылка на @entity_type_label','ru',0),(6736,'Ссылка на редактирование @entity_type_label','ru',0),(6737,'Предоставляет ссылку для редактирования @entity_type_label.','ru',0),(6738,'Ссылка для удаления @entity_type_label','ru',0),(6739,'Предоставляет ссылку для удаления @entity_type_label.','ru',0),(6740,'Представление','ru',0),(6741,'Такие настройки, как переключения страниц, сортировка таблицы и раскрытые фильтры, не будут вызывать обновление страницы.','ru',0),(6742,'Выбрать постраничный навигатор','ru',0),(6743,'Это может быть внутренний путь Drupal такой как node/add или внешний URL такой как \"https://www.drupal.org\". Вы можете использовать \"Подстановочные шаблоны\" указанные выше.','ru',0),(6744,'По умолчанию таблица скрывается для пустых представлений. С этой настройкой становится возможным показывать пустую таблицу с текстом внтури.','ru',0),(6745,'Теги кэша','ru',0),(6746,'Настройки формата отображения метки времени','ru',0),(6747,'Формат будущего времени','ru',0),(6748,'Прошедшее время','ru',0),(6749,'@requirements_message (Используется @item версия @version)','ru',0),(6750,'Система хранения MyISAM  не поддерживается.','ru',0),(6751,'0 секунд','ru',0),(6752,'Сбой проверки, поскольку значение конфликтует со значением  поля %field_name, к которому у вас нет доступа.','ru',0),(6753,'Невозможно удалить профиль %profile, поскольку он является установочным.','ru',0),(6754,'Модуль @module является обязательным','ru',0),(6755,'Используйте <em>@interval</em> там, где нужно вывести текст интервала.','ru',0),(6756,'Количество элементов интервала для отображения.','ru',0),(6757,'Будущая дата: %display','ru',0),(6758,'Прошлая дата: %display','ru',0),(6759,'- Часовой пояс сайта/пользователя по умолчанию -','