\"> INSTALL.txt </a>.','ru',0),(6915,'@drupal требует постоянные права на чтение для файла %file. Раздел документации <a href=\":handbook_url\">Проблемы веб-хостинга</a> предлагает справку для этой и других тем.','ru',0),(6916,'Установщик @drupal  во время установки требует права на запись в %file. Раздел документации <a href=\":handbook_url\">Проблемы веб-хостинга</a> предлагает справку по этой и другим темам.','ru',0),(6917,'Установщик @drupal не смог создать %file с правильным владельцем файла. Войдите на свой веб-сервер, удалите имеющийся файл %file и создайте новый путём копирования файла %default_file в %file. Подробная информация про установку Drupal доступна в файле <a href=\":install_txt\">INSTALL.txt</a>. Раздел документации <a href=\":handbook_url\">Проблемы веб-хостинга</a> предлагает справку по этой и другим темам.','ru',0),(6918,'Просмотрите сообщение и <a href=\":retry\">повторите попытку </a>, или вы можете <a href=\":cont\">продолжить в любом случае</a>','ru',0),(6919,'Прочитайте сообщения и <a href=\":url\">попробуйте ещё раз</a>.','ru',0),(6920,'Следующие модули являются обязательными, но они отсутствуют. Переместите их в соответствующий подкаталог модулей, например <em>/modules</em>. Отсутствующие модули: @modules','ru',0),(6921,'Обновление модуля @module','ru',0),(6922,'Постобработка обновления модуля @module','ru',0),(6923,'Несоответствие типа при переименовании. @old_type не соответствует @new_type для текущей @old_name и импортируемой @new_name конфигураций.','ru',0),(6924,'Переименование для простой конфигурации. Текущая @old_name и импортируемая @new_name конфигурации.','ru',0),(6925,'Ваш MySQL сервер и PHP MySQL драйвер должны поддерживать кодировку utf8mb4. Убедитесь, что вы используете базу данных, которая поддерживается (MySQL/MariaDB/Percona версии 5.5.3 и выше), и что поддержка кодировки utf8mb4 включена. Дополнительные сведения см. в <a href=\":documentation\" target=\"_blank\">MySQL documentation</a>.','ru',0),(6926,'База данных %driver для работы с Drupal должна использовать кодировку %encoding. Пересоздайте базу данных используя кодировку %encoding. Подробности смотрите в файле <a href=\"INSTALL.pgsql.txt\">INSTALL.pgsql.txt</a>.','ru',0),(6927,'Настройка %setting сейчас имеет значение \'%current_value\', но необходимо, чтоб было \'%needed_value\'. Измените его выполнив следующий запрос: <code>@query</code>','ru',0),(6928,'Дата (например @format)','ru',0),(6929,'Время (например, @format)','ru',0),(6930,'@uri','ru',0),(6931,'Работа в режиме технического обслуживания. <a href=\":url\">Переключиться в рабочий режим.</a>','ru',0),(6932,'Размер текстового поля: @size','ru',0),(6933,'Количество строк: @rows','ru',0),(6934,'Размер поля URI: @size','ru',0),(6935,'ВНИМАНИЕ: Вы не используете зашифрованное соединение, поэтому ваш пароль будет отправлен в виде обычного текста. <a href=\":https-link\">Подробнее</a>.','ru',0),(6936,'Невозможно соединится с сервером. От сервера получено следующее сообщение:<p class=\"error\">@message</p>. Дополнительную информацию про установку или обновления кода на сервере смотрите в <a href=\":handbook_url\">справочнике</a>','ru',0),(6937,'Форма уже устарела. Скопируйте все несохранённые данные формы и затем <a href=\":link\">перезагрузите эту страницу</a>.','ru',0),(6938,'@name не может превышать %max символов, а сейчас он длинной %length символов.','ru',0),(6939,'<ul>\r\n<li>Чтобы начать сначала, необходимо очистить существующую базу данных и скопировать файл <em>default.settings.php</em> поверх файла <em>settings.php</em>.</li>\r\n<li>Чтобы обновить уже установленную систему, используйте <a href=\":update-url\">сценарий обновления</a>.</li>\r\n<li>Посетите <a href=\":base-url\">существующий сайт</a>.</li>\r\n</ul>','ru',0),(6940,'Поскольку выполнены все необходимые изменения в %dir и %file, то в целях безопасности следует снять разрешения на запись в них. Если вы не знаете, как это сделать, обратитесь к <a href=\":handbook_url\">онлайн-справочнику</a>.','ru',0),(6941,'Система будет оповещать об обновлениях и важных выпусках безопасности, которые доступны для установленных компонентов. Анонимная информация о сайте отправлена на <a href=\":drupal\">Drupal.org</a>.','ru',0),(6942,'Передача файла не удалась, причина: @reason','ru',0),(6943,'Ограничение уникальности поля','ru',0),(6944,'Тип сущности @entity_type с полем @field_name %value уже существует.','ru',0),(6945,'Модуль Actions позволяет использовать задания, которые могут быть выполнены сайтом, такие как снятие материала с публикации, отправки почты или блокировки пользователя. Другие модули могут запускать эти действия когда происходят определённые системные события; например, когда публикуется новый материал или пользователь выполняет вход в систему. Модули также могут предоставлять свои действия. Дополнительную информацию смотрите в <a href=\":documentation\">онлайн-документации модуля Actions</a>.','ru',0),(6946,'<em>Простые действия</em> не требуют настройки и автоматически перечислены на странице <a href=\":actions\">Действия</a>.','ru',0),(6947,'<em>Расширенные действия</em> создаются пользователями и должны настраиваться отдельно. Расширенное действие создаётся на странице <a href=\":actions\">Действия</a> с помощью выбора типа действия из выпадающего списка. Затем необходимо настроить действие, например, ввести получателя автоматического электронного сообщения.','ru',0),(6948,'Сообщение для отправки. Для показа данных, которые будут изменяться при каждой отправке сообщения, можно использовать заполнители места в виде [node:title], [user:account-name], [user:display-name] и [comment:body] Некоторые заполнители места доступны только в определённых контекстах.','ru',0),(6949,'Сообщение для текущего пользователя. Для показа данных, которые будут изменяться при каждой отправке сообщения, можно использовать заполнители места в виде [node:title], [user:account-name], [user:display-name] и [comment:body] Некоторые заполнители места доступны только в определённых контекстах.','ru',0),(6950,'Модуль Aggregator это инструмент для синдикации материалов на сайте и чтения новостей, который собирает и отображает свежие материалы из RSS, RDF и Atom-каналов, делая их доступными между сайтами. Тысячи сайтов (особенно новостные и блоги) публикуют свои последние заголовки новостей в лентах, используя один из стандартизованных XML-форматов. За дополнительной информацией обращайтесь к <a href=\":aggregator-module\">онлайн-документации модуля Aggregator</a>.','ru',0),(6951,'Пользователи просматривают содержимое потока на <a href=\":aggregator\">основной странице сборщика</a>, или через <a href=\":aggregator-sources\">его источник</a> (обычно через считыватель RSS-потока). Последнее содержимое потока можно отобразить в блоке, который настраивается на административной странице <a href=\":admin-block\">Блоки</a>.','ru',0),(6952,'Настройки отображения для элементов ленты','ru',0),(6953,'Удаление старых элементов ленты','ru',0),(6954,'<a href=\":aggregator-opml\">Машиночитаемый OPML файл</a> доступный всем каналам. OPML представляет собой особый формат файла XML, который используется для обема иерархично-структуированной информации, к примеру RSS. Ленты также могут быть <a href=\":import-opml\">импортированы через OPML файл</a>.','ru',0),(6955,'Для автоматического обновления лент необходимо работающее <a href=\":cron\">задание cron по обслуживанию</a>','ru',0),(6956,'Список текущих лент указан ниже, также <a href=\":addfeed\">можно добавить новые</a>. Блок <em>новые записи</em> может быть включен на <a href=\":block\">странице администрирования блоков</a> для каждой из лент.','ru',0),(6957,'лента @title','ru',0),(6958,'Ленты отсутствуют. <a href=\":link\">Добавить ленту</a>.','ru',0),(6959,'Описание родительского сайта, которое приходит из элемента @description в ленте.','ru',0),(6960,'Продолжительность времени между обновлениями лент. Требуется правильная настройка <a href=\":cron\">задания cron</a>.','ru',0),(6961,'Требуется правильная настройка <a href=\":cron\">задания cron</a>.','ru',0),(6962,'Модуль Ban позволяет администраторам блокировать доступ к сайту для определённых IP-адресов. За дополнительной информацией обращайтесь к <a href=\":url\">онлайн-документации модуля Ban</a>.','ru',0),(6963,'Администраторы могут вводить IP адреса для блокировки на странице <a href=\":bans\">Блокировка IP адресов</a>.','ru',0),(6964,'Модуль \"Базовая HTTP-аутентификация\" (<a href=\"http://en.wikipedia.org/wiki/Basic_access_authentication\">HTTP Basic Authentication</a>) обеспечивает провайдера для запросов веб-сервисов. Данный провайдер аутентифицирует запросы с помощью имени пользователя и пароля HTTP Basic Authentication, в качестве альтернативы стандартной Drupal системы аутентификации на основе cookie. Это удобно, если ваш сайт реализует веб-сервисы, настроенные на использование данного типа аутентификации (к примеру, модуль <a href=\":rest_help\">RESTful веб-сервисы</a>). Дополнительную информацию смотрите в <a href=\":hba_do\">онлайн-документации</a>.','ru',0),(6965,'Модуль Block позволяет размещать блоки в областях установленных тем, а также настраивать параметры блока. Дополнительную информацию смотрите в <a href=\":blocks-documentation\">онлайн-документации о модуле Block</a>.','ru',0),(6966,'Увидеть место расположения областей для текущей темы можно нажав ссылку <em>Просмотр областей блоков</em> на странице <a href=\":blocks\">Схема блоков</a>. Размещение областей зависят от конкретной темы.','ru',0),(6967,'Чтобы изменить настройки отдельного блока нажмите ссылку <em>Настроить</em> на странице <a href=\":blocks\">Схема блоков</a>. Доступность опций зависит от модуля, предлагающего блок. Для всех блоков возможно изменить заголовок и включить или выключить их показ.','ru',0),(6968,'Вы можете добавлять пользовательские блоки, если установлен модуль <em>Custom Block</em>. Подробную информацию смотрите на странице <a href=\":blockcontent-help\">Справка модуля Custom Block</a>.','ru',0),(6969,'Настройки блока обновлены.','ru',0),(6970,'Отредактируйте пользовательский тип блока %label','ru',0),(6971,'Вы ещё не создали ни один тип блока. Перейдите на <a href=\":url\">страницу создания типа блока</a>, чтобы добавить новый.','ru',0),(6972,'Блока с uuid %uuid не существует. <a href=\":url\">Добавить пользовательский блок</a>.','ru',0),(6973,'Добавить <a href=\":url\">пользовательский блок</a>.','ru',0),(6974,'Модуль Book используется для создания структурированных и многостраничных материалов, таких, как руководства по использованию сайта, инструкций, энциклопедий. С его помощью можно создать материал, который состоит из глав, разделов, подразделов или других связанных подобным образом структур. Включение модуля создает новый тип материала <em>Страница книги</em>. Дополнительную информацию смотрите в <a href=\":book\">онлайн-документации модуля Book</a>','ru',0),(6975,'Можно предоставить отдельные полномочия для <em>создание новых книг</em>, а также <em>добавления</em>, <em>редактирования</em> и <em>удаления</em> материалов книги. Пользователи с полномочиями <em>Администрирование подшивок книги</em> могут добавлять <em>любые</em> типы материалов к книге, с помощью выбора соответствующей подшивки книги во время редактирования материала. Также можно просматривать список всех книг, добавлять, редактировать и пересортировывать названия разделов на странице <a href=\":admin-book\">Список книг </a>.','ru',0),(6976,'Тип материала <em>Страница книги</em> - это начальный тип материала, который включен для подшивок книг. На странице <a href=\":admin-settings\">Настройка книги</a> можно настроить типы материала, которые можно использовать.','ru',0),(6977,'Пользователям с правами <em>Добавление материалов и дочерних страниц книги</em> отобразится ссылка <em>Добавить дочернюю страницу</em> во время просмотра материала, входящего в подшивку книги. Это ссылка позволяет пользователям создавать новую запись для типа материала, выбранного на странице <a href=\":admin-settings\">Настройка книги</a>. По умолчанию это тип материала <em>Страница книги</em>.','ru',0),(6978,'Страницы книг имеют встроенный навигационный блок, напоминающий книгу. Этот блок содержит ссылки, ведущие на предыдущую и следующую страницы книги. Или же на уровень выше в структуре книги. Этот блок можно включить на административной странице <a href=\':admin-block\'>Схема блоков</a>. Чтобы страницы книг отображались в навигационном блоке, их нужно добавить в подшивку книги.','ru',0),(6979,'Подшивка позволяет добавлять страницы в <a href=\":book\">Иерархию книги</a>, а также переносить их в пределах иерархии или <a href=\":book-admin\">перегруппировать всю книгу</a>.','ru',0),(6980,'Родительская страница в книге. Максимальная вложенность книги и всех дочерних страниц равна @maxdepth. Некоторые страницы выбранной книги могут быть недоступными как родительские, если при их выборе будет превышен лимит.','ru',0),(6981,'Модуль Breakpoint позволяет устанавливать высоту, ширину и разрешение экрана, при которых должен изменяться адаптивный дизайн, для корректного отображения на различных устройствам, которые используются для просмотра сайта. Данный модуль не имеет своего интерфейса. Дополнительную информацию смотрите в <a href=\":docs\">онлайн-документации</a>.','ru',0),(6982,'<a href=\":w3\">Медиа-запросы</a> - это формальный способ кодирования точек перехода. Например, ширина точки перехода в 40em будет записана как медиа-запрос \"(min-width: 40em)\". Точки перехода - это обычные медиа-запросы с некоторыми дополнительными метаданными, к примеру названием и информация о коэффициенте.','ru',0),(6983,'Модуль CKEditor предоставляет очень доступный, удобный визуальный редактор и добавляет панель инструментов к текстовым полям. Пользователи могут использовать кнопки для форматирования контента и для создания семантически правильного и корректного HTML. Модуль CKEditor использует структуру предоставленную модулем <a href=\":text_editor\">Text Editor</a>. Необходим включенный JavaScript в браузере. Дополнительную информацию смотрите в <a href=\":doc_url\">онлайн документации модуля CKEditor</a> и на сайте <a href=\":cke_url\">CKEditor</a>.','ru',0),(6984,'CKEditor должен быть включен и настроен для каждого текстового формата на странице <a href=\":formats\">Текстовые форматы и редакторы</a>, потому что параметры фильтров для каждого текстового формата могут отличаться. Дополнительную информацию смотрите на страницах <a href=\":text_editor\">Справка о текстовом редакторе</a> и <a href=\":filter\">Справка о фильтрах</a>.','ru',0),(6985,'CKEditor позволяет пользователям форматировать материал, согласно конфигурации фильтров выбранного текстового формата. Если текстовый формат исключает определенные HTML-теги, соответствующие кнопки не будут отображаться на панели инструментов во время редактирования поля с данным текстовым форматом. Дополнительную информацию смотрите на странице <a href=\":filter\">Справка про фильтры</a>.','ru',0),(6986,'Встроенный WYSIWYG-редактор (CKEditor) поставляется с несколькими <a href=\":features\">специальными возможностями</a>. Также в CKEditor присутствуют <a href=\":shortcuts\">клавиатурные сокращения</a>, которые могут пригодиться как для опытных пользователей, так и для пользователей, использующих только клавиатуру.','ru',0),(6987,'Модуль Color позволяет пользователям с правами <em>Управление настройками сайта</em> изменять цветовую схему  (цвет ссылок, фона, текста, и других элементов) совместимых тем. Дополнительную информацию смотрите <a href=\":color_do\">онлайн документацию модуля Color</a>.','ru',0),(6988,'Модуль комментариев позволяет пользователям комментировать материалы на сайте, установить возможность комментирования по умолчанию, права на работу с комментариями и управлять комментариями. Подробнее на странице <a href=\":comment\">Онлайн документация к модулю комментариев</a>.','ru',0),(6989,'Включение комментирования','ru',0),(6990,'Настройка параметров комментирования','ru',0),(6991,'Настройка комментирования может быть выполнена через редактирование поля <em>Комментарии</em> на странице <em>Управление полями</em> для типа сущности, если включен <em>модуль Field UI</em>. Конфигурация включает в себя метку поля комментария, количество комментариев для показа, возможность их показа в виде древовидного списка. Комментирование может иметь следующие состояния: <em>Открыто</em>, когда новые новые комментарии разрешены; <em>Закрыто</em>, когда разрешено просматривать имеющиеся комментарии, но запрещено добавлять новые, или <em>Скрыто </em>, когда убраны имеющиеся комментарии и запрещено добавлять новые. Изменение данной конфигурации для типа сущности не изменит уже имеющиеся экземпляры сущности.','ru',0),(6992,'Пользователи с соответствующими правами могут переопределить настройки комментирования по умолчанию для типа сущности при создании ее экземпляра.','ru',0),(6993,'Комментарии публикуются сразу от пользователей, которые имеют право <em>пропускать проверку комментария</em> . Все остальные комментарии распогалаются на странице <a href=\":comment-approval\">Непроверенные комментарии</a>, пока пользователь который имеет разрешение <em>управлять комментариями и настройками комментариев</em> опубликует или удалить их. Опубликованные комментарии могут быть массово изменены на странице <a href=\":admin-comment\">Опубликованные комментарии</a>. Когда комментарий не имеет ответов, автор комментария может редактировать его, если имеет разрешение <em>редактировать собственные комментарии</em>.','ru',0),(6994,'Ответ на @parent_title от @parent_username','ru',0),(6995,'Имя для @anonymous','ru',0),(6996,'<a href=\":login\">Войдите</a> или <a href=\":register\">зарегистрируйтесь</a>, чтобы оставлять комментарии','ru',0),(6997,'<a href=\":login\">Войдите</a>, чтобы оставлять комментарии','ru',0),(6998,'Выберите тип комментария для использования этого поля комментария. Вы можете управлять типами комментариев на странице <a href=\":url\">обзорная страница управления</a>.','ru',0),(6999,'Модуль Configuration Manager предоставляет пользовательский интерфейс для импорта и экспорта изменений настроек между установленными версиями вашего сайта в различных окружениях. Настройки хранятся в формате YAML. Дополнительную информацию смотрите в  <a href=\":url\">онлайн документации модуля Configuration Manager</a>.','ru',0),(7000,'Вы можете создать и загрузить архив, который содержит конфигурацию всего сайта, экспортированную в файлы <em>*.yml</em> на странице <a href=\":url\">Экспорт</a>.','ru',0),(7001,'Вы можете выгрузить полную конфигурацию сайта из файла архива на странице <a href=\":url\">Импорт</a>. При импорте данных из другого окружения у сайта и импортируемых файлов должны совпадать конфигурационные значения для UUID в элементе конфигурации <em>system.site</em>. Это означает, что другие окружения должны быть изначально настроены как клоны целевого сайта. Переносы не поддерживаются.','ru',0),(7002,'Вы можете посмотреть различия между активной конфигурацией и архивом импортируемой конфигурации на странице <a href=\":synchronize\">Синхронизировать</a>, чтобы убедиться в ожидаемых изменениях перед выполнением импорта. Страница \"Синхронизировать\" также отображает элементы конфигурации, которые будут добавлены или удалены.','ru',0),(7003,'Вы можете импортировать одиночную запись конфигурации через вставку в YAML формате в форму на странице <a href=\":single-import\">Одиночный импорт</a>.','ru',0),(7004,'Экспортировать и скачать полную конфигурацию этого сайта в одном файле формата tar.gz.','ru',0),(7005,'Выберите элемент конфигурации для отображения его YAML-структуры.','ru',0),(7006,'Импортировать элемент конфигурации путём вставки его YAML-структуры в текстовое поле.','ru',0),(7007,'Полный архив','ru',0),(7008,'Один элемент','ru',0),(7009,'Подготовленная','ru',0),(7010,'Следующие элементы в вашей активной конфигурации имеют изменения с момента последнего импорта, так что они могут быть потеряны при следующем импорте.','ru',0),(7011,'Конфигурационная коллекция @collection','ru',0),(7012,'@source_name в @target_name','ru',0),(7013,'Чтобы переводить конфигурацию, сайт должен иметь по крайней мере два <a href=\":url\">языка</a>.','ru',0),(7014,'Пользователи с разрешением <em>переводить редактируемую пользователем конфигурацию</em> имеют доступ к обзору перевода конфигурации и управлению переводами на другие языки. На странице <a href=\":translation-page\">перевод конфигурации</a> показан лист всех текстов конфигурации, которые могут быть переведены, как отдельные элементы или как списки. После того как вы кликните на <em>перевести</em>, вам будет предоставлен список всех языков. Вы можете <em>добавить</em> или <em>изменить</em> перевод для конкретного языка. Пользователи с конкретными разрешениями могут также <em>редактировать</em> текст для языка сайта по умолчанию. Для некоторых текстов элементов конфигурации (например для информации о сайте), конкретные страницы переводов могут быть доступны прямо на этих же страницах.','ru',0),(7015,'Вы можете перевести форматы дат на странице <a href=\":translation-page\">Перевод конфигурации</a>. Это позволит вам перевести не только текст заголовков, но также установить специфический <em>PHP формат даты</em>.','ru',0),(7016,'@label <span class=\"visually-hidden\">(@source_language)</span>','ru',0),(7017,'Модуль Контакты позволяет посетителям связаться с зарегистрированным пользователем на вашем сайте, используя персональную форму контактов, также позволяет вам установить контактную форму для всего сайта. Больше информации на странице <a href=\":contact\">онлайн документация по модулю Контакт</a>.','ru',0),(7018,'[@form] @subject','ru',0),(7019,'@sender-name (@sender-url) отправил сообщение, используя контактную форму по ссылке @form-url.','ru',0),(7020,'[@site-name] @subject','ru',0),(7021,'Здравствуйте, @recipient-name,','ru',0),(7022,'@sender-name (@sender-url) отправил вам сообщение через вашу контактную форму на сайте @site-name.','ru',0),(7023,'Если вы не желаете получать подобные электронные сообщения, то измените настройки на странице @recipient-edit-url.','ru',0),(7024,'@name (не подтвержден)','ru',0),(7025,'Контактная форма ещё не настроена. <a href=\":add\">Добавьте одну или несколько форм</a>.','ru',0),(7026,'Модуль Перевод содержимого позволяет перевести материалы, комментарии, пользовательские блоки, термины таксономии, пользователей и другие <a href=\":field_help\" title=\"Справка модуля Поля\">материалы сущностей</a>. Вместе с модулями <a href=\":language\">Язык</a>, <a href=\":config-trans\">Перевод конфигурации</a> и <a href=\":locale\">Перевод интерфейса</a> позволит вам построить мультиязычный сайт. Больше информации смотрите на странице <a href=\":translation-entity\">Онлайн документация для модуля Перевод содержимого</a>.','ru',0),(7027,'Для возможности перевода материалов необходимо, чтобы на странице <a href=\":url\">Администрирование языков</a> было добавлено по крайней мере два языка.','ru',0),(7028,'Настроить перевод этого поля, <a href=\":language-settings-url\">включить поддержку языка</a> для этого типа.','ru',0),(7029,'<a href=\":settings_url\">Включить перевод</a> для <em>типов материалов</em>, <em>словарей таксономии</em>, <em>учётных записей</em> или  других элементов, которые желательно перевести.','ru',0),(7030,'Наведение на интересующую область временно сделает кнопку контекстных ссылок видимой (выглядит как карандаш в большинстве тем и обычно отображается в правом верхнем углу области). Иконка обычно выглядит так: @picture','ru',0),(7031,'Если модуль <a href=\":toolbar\">Toolbar</a> включён, нажатие на кнопку контекстных ссылок в панели инструментов (которая выглядит как карандаш) сделает все контекстные ссылки на странице видимыми. Повторное нажатие на кнопку сделает их невидимыми.','ru',0),(7032,'<em>Настройки</em> и <em>отображение</em> поля даты могут быть настроены отдельно. Смотрите больше информации на странице <a href=\":field_ui\">Поля пользовательский интерфейс</a> как управлять полями и их отображением.','ru',0),(7033,'Последовательность частей даты: @order','ru',0),(7034,'Тип времени: @time_type','ru',0),(7035,'Интервалы увеличения времени: @increment','ru',0),(7036,'Модуль Database Logging записывает системные события в базу данных Drupal. За дополнительной информацией обращайтесь к  <a href=\":dblog\">онлайн-документации модуля Database Logging</a>.','ru',0),(7037,'В случае возникновения ошибок или проблем с сайтом для отладки может пригодится страница <a href=\":dblog\">Последние записи журнала</a>, которая отображает последовательность происходящих событий. Сообщения журнала включают в себя информацию об использовании, предупреждения и ошибки.','ru',0),(7038,'Максимальное число сообщений, которые будут храниться в журнале базы данных. Необходима настройка <a href=\":cron\">задания cron</a>.','ru',0),(7039,'Страницы, которые подходят для кэширования будут закэшированы при первом запросе к ним и затем кэшированная версия будет использована для всех остальных запросов. Динамическое содержимое обрабатывается таким образом, что поддерживается и корректность кэша и процент чтений из него.','ru',0),(7040,'Внутренний динамический кэш страниц','ru',0),(7041,'Кэширование страниц для всех пользователей, правильная обработка динамического содержимого.','ru',0),(7042,'Ни одного приемлемого представления не найдено. <a href=\":create\">Создайте представление</a> с отображением <em>Ссылка на сущность</em> или добавьте такое отображение к <a href=\":existing\">уже созданному представлению</a>.','ru',0),(7043,'Поля ещё не созданы. Вы можете добавить новое поле на странице <a href=\":link\">Управление полями</a>','ru',0),(7044,'Вид отображения %display_mode использует пользовательские настройки. Вы можете <a href=\":url\">настроить их</a>.','ru',0),(7045,'Ограничение @size.','ru',0),(7046,'Файл из поля @field_name','ru',0),(7047,'Модуль File позволяет создавать поля содержащие файлы. Смотрите страницы <a href=\":field\">Справка к модулю Field</a> и <a href=\":field_ui\">Справка к модулю Field UI</a> для получения общих сведений о создании и управлении полями. Для получения подробной информации обратитесь к <a href=\":file_documentation\">online документации к модулю File </a>.','ru',0),(7048,'<em>Настройки</em> и <em>отображение</em> поля задаются независимо друг от друга. Смотрите страницу <a href=\":field_ui\">Справка к модулю Field UI</a> для получения информации о настройке и отображении полей.','ru',0),(7049,'Отгруженные файлы могут быть сохранены как  <em>общедоступные</em> или <em>личные</em>, в зависимости от <a href=\":file-system\">настроек файловой системы</a>. Больше информация на странице <a href=\":system-help\">Справка модуля System</a>.','ru',0),(7050,'На файл, использованный в поле @name, невозможно ссылаться.','ru',0),(7051,'Файл, на который ссылается поле @name, не существует.','ru',0),(7052,'Используйте текстовый формат <a href=\":url\">@label</a>','ru',0),(7053,'За дополнительной информацией обратитесь к <a href=\":html-specifications\">Спецификации HTML</a> от W3C  или используйте предпочтительную поисковую систему для поиска других сайтов с объяснением HTML.','ru',0),(7054,'Если возникают проблемы, попробуйте использовать мнемонические символы HTML, например, &amp;amp для символа амперсанда &amp;. Полный список мнемонических символов смотрите на странице спецификации HTML о <a href=\":html-entities\">мнемониках</a>. Некоторые доступные символы:','ru',0),(7055,'Ограничить разрешённые HTML-теги и исправить ошибочный HTML','ru',0),(7056,'Модуль Форум добавляет и использует тип материалов <em>Тема форума </em>. Общую информацию о типах материалов смотрите на странице <a href=\":node_help\">Справка модуля Node</a>.','ru',0),(7057,'Подробнее в <a href=\":forum\">онлайн-документации модуля Форум</a>.','ru',0),(7058,'Для настройки контейнеров и форумов с темами обсуждения посетите страницу <a href=\":forums\">Форумы</a>','ru',0),(7059,'Ссылка <a href=\":create-topic\">тема форума</a> на странцие <a href=\":content-add\">добавить материал</a> создает первое сообщение нового обсуждения.','ru',0),(7060,'Настройте отображение тем форума. Упорядочить форумы можно на странице <a href=\":forum-structure\">Структура форумов</a>.','ru',0),(7061,'Для удаления модуля форума, сначала удалите все термины словаря <a href=\":url\">%vocabulary</a>','ru',0),(7062,'Нет доступных контейнеров или форумов. <a href=\":container\">Добавьте контейнер</a> или <a href=\":forum\">добавьте форум</a>.','ru',0),(7063,'<a href=\":hal_spec\">Гипертекстовый язык приложений (Hypertext Application Language)</a> это формат, который поддерживает ссылки требуемые для гипермедиа API.','ru',0),(7064,'Этот модуль добавляет поддержку сериализованных сущностей (таких как типы материалов, термины таксономии, и т.д.) в JSON версию HAL. За дополнительной информацией обратитесь к <a href=\":hal_do\">онлайн-документацию модуля HAL</a>.','ru',0),(7065,'<strong>Настроить ваш сайт</strong> Когда вы авторизованы, перейдите на <a href=\":admin\">Страницу администрирования</a>, чтобы получить возможность <a href=\":config\">настроить</a> все аспекты сайта.','ru',0),(7066,'<strong>Настроить внешний вид сайта</strong> Для изменения отображения сайта перейдите на <a href=\":themes\">Страницу оформления</a>. Вы сможете выбрать одну из предустановленных тем оформления или скачать дополнительную со <a href=\":download_themes\">Страницы с темами оформления на сайте Drupal.org</a>.','ru',0),(7067,'<strong>Начать публикацию содержимого</strong> Наконец-то, вы можете <a href=\":content\">добавить новое содержимое</a> на ваш сайт.','ru',0),(7068,'Модуль Help хранит информацию о том, какое содержимое было просмотрено пользователем. Это помечает содержимое меткой \"новое\" или \"обновлено\", в зависимости от того, когда содержимое было просмотрено пользователем. Записи истории старше одного месяца удаляются через cron, это означает что содержимое старше одного месяца всегда определяется как \"прочитанное\". Модуль истории не имеет пользовательского интерфейса, но предоставляет фильтр для <a href=\":views-help\">Представлений</a> для показа нового или обновленного содержимого.  Для дополнительной информации просмотрите <a href=\":url\">онлайн-документацию модуля Help</a>.','ru',0),(7069,'изображение из @field_name','ru',0),(7070,'Стили сейчас отсутствуют. <a href=\":url\">Добавить новый</a>.','ru',0),(7071,'Основной идентификатор для стиля изображения.','ru',0),(7072,'Машинное имя стиля.','ru',0),(7073,'Административное имя стиля.','ru',0),(7074,'Определите порядок языков ниже. Данный порядок будет использоваться при редактировании материалов в поле выбора языка. Этот порядок не влияет на <a href=\":detection\">определение и выбор</a>.','ru',0),(7075,'Также может быть задан язык сайта по умолчанию. Не рекомендуется изменять язык сайта по умолчанию на работающих сайтах. На странице <a href=\":language-detection\"> Определения и выбора языка</a> Вы можете задать настройки  выбора языка при определенных условиях.','ru',0),(7076,'Браузеры используют различные языковые коды для одних и тех же языков. Лучший вариант - задать внутреннее определение корректных языковых кодов на основе кодов, посылаемых браузерами. Здесь Вы можете добавить и редактировать дополнительные соответствия языковых кодов браузера и выбранных <a href=\":configure-languages\">языков</a>.','ru',0),(7077,'Измените выбранный язык здесь (и оставьте данную опцию как последний метод обнаружения и выбора языка) - это простейший способ для задания языка по умолчанию для вашего сайта (например, когда Вы не используете префикс пути или языковой домен). <a href=\":admin-change-language\">Изменение языка по умолчанию для сайта</a> может дать другие нежелательные побочные эффекты.','ru',0),(7078,'Пояснение настроек языка находится на странице <a href=\":languages_list_page\">список языков</a>.','ru',0),(7079,'Язык сайта по умолчанию (@language)','ru',0),(7080,'Для оперативной совместимости используйте языковые коды <a href=\":w3ctags\">заданные W3C</a>. <em>Примеры: \"en\", \"en-gb\" и \"zh-hant\".</em>','ru',0),(7081,'Один файл переводов невозможно проверить. Подробности в <a href=\":url\">журнале</a>.@count файла переводов невозможно проверить. Подробности в <a href=\":url\">журнале</a>.@count файлов переводов невозможно проверить. Подробности в <a href=\":url\">журнале</a>.','ru',0),(7082,'Один файл переводов невозможно импортировать. Подробности в <a href=\":url\">журнале</a>.@count файла переводов невозможно импортировать. Подробности в <a href=\":url\">журнале</a>.@count файлов переводов невозможно импортировать. Подробности в <a href=\":url\">журнале</a>.','ru',0),(7083,'Одна строка перевода была пропущена из-за недопустимого или повреждённого HTML. Подробности в <a href=\":url\">журнале</a>.@count строки перевода были пропущены из-за недопустимого или повреждённого HTML. Подробности в <a href=\":url\">журнале</a>.@count строк перевода было пропущено из-за недопустимого или повреждённого HTML. Подробности в <a href=\":url\">журнале</a>.','ru',0),(7084,'Файлы переводов с переведённым текстом интерфейса автоматически импортируются при добавлении нового языка на странице <a href=\":languages\">Языки</a> или после включения нового модуля или темы. На странице <a href=\":locale-settings\">Настройки перевода интерфейса</a> сам <em>Источник перевода</em> может быть ограничен только локальными файлами либо включать в себя в том числе и данные с <a href=\":server\">сервера переводов Drupal</a>. Хотя переводы модулей и тем все языки могут быть неполными, новые переводы появляются довольно часто. На странице <a href=\":locale-settings\">Настройки перевода интерфейса</a> можно указать, проверять ли и как часто проверять файлы переводов на наличие обновлений. Также на странице <a href=\":import\">Импорт перевода интерфейса</a> можно самостоятельно импортировать файл перевода.','ru',0),(7085,'Интерфейс перевода автоматически импортирует перевод когда производиться добавление нового языка или когда включается новый модуль или тема. Отчет <a href=\":update\">Доступные обновления перевода</a> показывает текущий статус перевода. Текст интерфейса сайта может быть изменен на странице <a href=\":translate\">Перевод пользовательского интерфейса</a>.','ru',0),(7086,'Страница позволяет создавать и редактировать переводы, переводчики могут искать переведенные и не переведенные строки. (Примечание: Так как задача перевода может затрагивать много строк, для большего удобства можно <a title=\"Экспорт перевода пользовательского интерфейса\" href=\":export\">экспортировать</a> строки для оффлайн перевода в редакторе переводов Gettext.) Поиск может быть ограничен строками на определенном языке.','ru',0),(7087,'Доступны обновления для следующих языков: @languages. Дополнительную информацию смотрите на странице <a href=\":updates\">Доступные обновления переводов</a>.','ru',0),(7088,'Отсутствуют переводы для следующих языков: @languages. Дополнительную информацию смотрите на странице <a href=\":updates\">Доступные обновления переводов</a>.','ru',0),(7089,'Статусы переводов недоступны. Дополнительную информацию смотрите на странице <a href=\":updates\">Доступные обновления переводов</a>.','ru',0),(7090,'Настройки перевода интерфейса','ru',0),(7091,'Импорт переводов интерфейса','ru',0),(7092,'Экспорт перевода интерфейса','ru',0),(7093,'Выберите частоту проверки обновлений переводов интерфейса для установленных модулей и тем оформления. <a href=\":url\">Проверить обновления сейчас</a>.','ru',0),(7094,'Файлы перевода сохраняются локально в каталоге %path. Изменить данный каталог можно на странице конфигурации <a href=\":url\">Файловая система</a>.','ru',0),(7095,'Доступные для перевода языки отсутствуют. Сначала <a href=\":add_language\">добавьте язык</a>.','ru',0),(7096,'Состояние переводов недоступно. <a href=\":check\">Проверить вручную</a>.','ru',0),(7097,'Включить недавно созданный блок для данного меню можна на странице <a href=\":blocks\">Схема блоков</a>.','ru',0),(7098,'Каждое меню имеет соответствующий блок, который управляется на странице <a href=\":blocks\">Схема блоков</a>.','ru',0),(7099,'Ссылки меню пока отсутствуют. <a href=\":url\">Добавить ссылку</a>.','ru',0),(7100,'Модуль Migrate предоставляет каркас для миграции данных, обычно из внешнего источника в ваш сайт. Модуль не предоставляет пользовательского интерфейса. Больше информации смотрите на странице <a href=\":migrate\">онлайн документации модуля Migrate</a>.','ru',0),(7101,'Миграция завершилась неудачей в связи с исключением в плагине источника: @e','ru',0),(7102,'Использование памяти @usage (@pct% от лимита @limit), освобождаем память.','ru',0),(7103,'Использование памяти в данный момент @usage (@pct% от лимита @limit) — затребовано недостаточно, начинаем новый пакет','ru',0),(7104,'Использование памяти в данный момент @usage (@pct% от лимита @limit) — затребовано достаточно, продолжаем','ru',0),(7105,'Модуль Migrate предоставляет фреймворк основанный на <a href=\":migrate\">модуле migrate</a> способствующий миграции из Drupal (6, 7 или 8) сайта на ваш сайт. Модуль не предоставляет пользовательский интерфейс. Для большей информации смотрите <a href=\":migrate_drupal\">онлайн документация для модуля Migrate</a>','ru',0),(7106,'Права доступа к материалам необходимо обновить. <a href=\":node_access_rebuild\">Обновить права</a>.','ru',0),(7107,'Модуль Node управляет созданием, редактированием, удалением, настройкой и отображением основного содержимого сайта. Элементы содержимого, управляемые через модуль Node, обычно отображаются как страницы вашего сайта, включая заголовок, некоторые мета-данные (автор, время создания, тип материала и т.д.) и дополнительные поля, содержащие текст или другие данные (поля управляются через <a href=\":field\">модуль Field</a>). Смотрите больше информации в <a href=\":node\">онлайн документации модуля Node</a>.','ru',0),(7108,'Если на вашем сайте наблюдаются проблемы с доступом к документам, вы можете перестроить кэш прав. Перестройка прав удалит все разрешения на доступ к документам и заменит их значениями основанными на текущих включенных модулях и выставленных параметрах. Эта операция может занять продолжительное время особенно если существует много содержимого со сложными правами. После завершения процесса перестройки кэша, содержимое будет автоматически использовать новые разрешения. <a href=\":rebuild\">Перестроить разрешения</a>','ru',0),(7109,'Данный текст будет отображаться на странице <em>Добавить новый материал</em>.','ru',0),(7110,'Нет доступных типов материала. <a href=\":link\">Добавить тип материала</a>.','ru',0),(7111,'Материал из URL','ru',0),(7112,'Модуль Options позволяет создавать поля, значения в которых выбраны из фиксированного списка опций. Чаще всего эти элементы вводятся через select list, checkboxes, или radio buttons. См. также страницы <a href=\":field\">справка модуля Field</a> и <a href=\":field_ui\">справка Field UI</a> для получения информации по их созданию и управлению. Для более детальной информации посетите страницу <a href=\":options_do\">онлайн документации модуля Options</a>.','ru',0),(7113,'Модуль Internal Page Cache кэширует страницы для неавторизованных пользователей в базу данных. Для более детальной информации посетите <a href=\":pagecache-documentation\"> онлайн документацию модуля Internal Page Cache</a>.','ru',0),(7114,'Модуль Path позволяет вам сделать синоним ссылки или собственную ссылку для любого существующего в системного пути. Синонимы не должны пересекаться с URL перенаправлениями, которые позволяют пересылать измененный или не активный URL на новый URL. В дополнение делает URL-ы более читаемыми. Синонимы также помогают поисковым системам индексировать содержимое страниц более эффективно. Множество синонимов может вести на один и тот же системный путь. Для автоматизации синонимов вы можете установить модуль <a href=\":pathauto\">Pathauto</a>. Для более детальной информации посетите <a href=\":path\">онлайн документацию модуля Path</a>.','ru',0),(7115,'Нет доступных URL-синонимов. <a href=\":link\">Добавить синоним URL</a>.','ru',0),(7116,'Внутренний системный путь.','ru',0),(7117,'Синоним пути.','ru',0),(7118,'Модуль Responsive Image обеспечивает форматирование изображений, позволяя браузерам выбрать подходящий файл изображения на основе медиа-запросов или типов файлов поддерживаемых браузером, используя элемент HTML 5 picture и/или атрибуты sizes, srcset и type. Дополнительную информацию смотрите в <a href=\":responsive_image\">онлайн-документации модуля Responsive Image</a>.','ru',0),(7119,'Создавая адаптивные стили изображений вы определяете, какие варианты есть у браузера для выбора файла для отображения. В большинстве случаев это означает наличие различных размеров изображения в зависимости от размера экрана. На странице <a href=\":responsive_image_style\">Адаптивные стили изображений</a>, нажмите <em>Добавить адаптивный стиль изображений</em> чтобы создать новый стиль. Сначала выберите метку, резервный стиль изображения и группу точек останова и нажмите кнопку \"Сохранить\".','ru',0),(7120,'Смотрите <a href=\":responsive_image_help\">Страницу помощи по адаптивным изображениям</a> для получения информации об атрибуте размера.','ru',0),(7121,'Настроить адаптивные стили изображения','ru',0),(7122,'Некоторые плагины страниц поиска, например системная страница поиска содержимого, индексируют искомый текст с помощью поискового индекса ядра Drupal и не работают пока материал не проиндексирован. Индексирование выполняется во время запуска <em>cron</em>, поэтому это требует настройки <a href=\":cron\">задания cron</a>. Есть ещё несколько настроек, которые влияют на индексирование и могут быть настроены на странице <a href=\":search-settings\">Страницы поиска</a>: количество элементов, индексируемых за один запуск крона, минимальная длина слова для индексации и способ обработки китайских, японских и корейских иероглифов.','ru',0),(7123,'… @excerpt … @excerpt …','ru',0),(7124,'Этот модуль не имеет пользовательского интерфейса. Он используется другими модулями, которым необходимо сериализовать данные, такими как <a href=\":rest\">REST</a>.','ru',0),(7125,'Смотрите больше информации на странице <a href=\":doc_url\">онлайн документации для модуля Serialization</a>.','ru',0),(7126,'Определите какие закладки используются в <a href=\":shortcut-link\">Панели ярлыков</a> на странице вашей учётной записи.','ru',0),(7127,'Ярлыки отсутствуют. <a href=\":link\">Добавить ярлык</a>','ru',0),(7128,'Сейчас вы используете новый набор ссылок %set_name. Вы можете его редактировать на этой странице <a href=\":switch-url\">поменять набор ссылок.</a>','ru',0),(7129,'Основной ключ menu.mlid для данного пункта меню (= ссылка ярлыка)','ru',0),(7130,'menu_name (= установленное имя) для данного ярлыка.','ru',0),(7131,'Ссылка для этого ярлыка.','ru',0),(7132,'Заголовок этого ярлыка.','ru',0),(7133,'Вес этого ярлыка','ru',0),(7134,'Имя, под которым будут сохранены ссылки набора.','ru',0),(7135,'Заголовок набора.','ru',0),(7136,'users.uid для этого набора.','ru',0),(7137,'shortcut_set.set_name, которое будет отображено этому пользователю.','ru',0),(7138,'Модуль Testing предоставляет фреймворк для запуска автоматических тестов. Он может быть использован для потверждения работающего состояния сайта на Drupal перед или после любого изменения в коде или для разработчиков, которые пишут или выполняют тесты для их модулей. Больше информации смотрите на странице <a href=\":simpletest\">онлайн документация для модуля Testing</a>.','ru',0),(7139,'Посетите страницу <a href=\":admin-simpletest\">Тестирования</a> со списком всех доступных тестов. Для всестороннего тестирования, выберите <em>все</em> тесты или отдельные тесты для более целевого тестирования. Обратите внимание, что выполнение всех тестов может занять несколько минут.','ru',0),(7140,'Система тестирования требует ограничение по PHP памяти по крайней мере %memory_minimum_limit. Текущее значение — %memory_limit. <a href=\":url\">Для продолжения выполните следующие действия</a>.','ru',0),(7141,'Как долго должна кешироваться статистика, т.е. интервал обновления','ru',0),(7142,'Версия: @module-version','ru',0),(7143,'Требует: @module-list','ru',0),(7144,'Требуется для: @module-list','ru',0),(7145,'Для данной темы требуется PHP версии @php_required и она не совместима с PHP версии @php_version.','ru',0),(7146,'На сайте есть несколько каталогов файлов, используемых для хранения и обработки закачанных и сгенерированных файлов. Каталог <em>общедоступных</em> файлов, настраиваемый в файле settings.php, это стандартное место для хранения закачанных файлов. Ссылки на файлы в этом каталоге содержат прямые URL-адреса файлов. Поэтому во время запроса на файлы веб-сервер отправляет их напрямую без выполнения кода сайта. Это означает, что файл может быть загружен кем угодно, кто имеет URL-адрес файла, то есть запросы не выполняют управление доступом, но они быстры. Каталог <em>личных</em> файлов также настраивается в файле settings.php и в идеале располагается за пределами корневого каталога сайта и имеет управление доступом. Ссылки на файлы этого каталога являются косвенными, поэтому запросы на эти файлы выполняются через код сайта. Это означает, что сайт, прежде чем выполнить запрос, проверяет права доступа на каждый файл, поэтому запросы более безопасны, но менее быстры. Личное хранилище нужно применять только к файлам, которые требуют управления доступом, а не к таким файлам как логотип или фоновое изображение, используемое на каждой странице. Каталог <em>временных</em> файлов используется кодом сайта для различных внутренних операций и настраивается на странице <a href=\":file-system\">Настройка файловой системы</a>. На этой странице можно увидеть настройки каталогов общедоступных и личных файлов, и выбрать каталог, общедоступный или личный, который является каталогом по умолчанию для закачанных файлов.','ru',0),(7147,'Установите и настройте тему, которая будет использоваться на сайте по умолчанию. Доступны альтернативные <a href=\":themes\">темы</a>','ru',0)