 <a href=\":module\">странице расширений</a> для того, чтобы поддерживать код вашего сайта в актуальном состоянии. Более подробная информация доступна на <a href=\":update\">странице онлайн документации модуля Update status</a>.','ru',0),(7161,'В settings.php не настроена переменная trusted_host_patterns. Это потенциальная угроза безопасности вашего сайта. <strong>Крайне рекомендуется</strong> настроить этот параметр. Более подробная информация доступна на странице <a href=\":url\">Защита против HTTP HOST Header атак</a>.','ru',0),(7162,'Переведите ваш сайт в <a href=\":url\">режим технического обслуживания</a>.','ru',0),(7163,'Все ошибки были <a href=\":url\">добавлены в журнал</a>','ru',0),(7164,'Обновления были выполнены. Если вы не видите никаких ошибок под этим сообщением, то можете спокойно продолжить пользоваться вашим <a href=\":url\">сайтом</a>. В противном случае вам придётся обновить вашу базу данных вручную.','ru',0),(7165,'На вашем сайте выявлено несколько проблем. Зайдите на страницу <a href=\":status\">Отчёт о состоянии</a> для получения подробной информации.','ru',0),(7166,'Снимок экрана темы оформления @theme','ru',0),(7167,'Настройки темы оформления @theme','ru',0),(7168,'Удалить тему оформления @theme','ru',0),(7169,'Использовать @theme в качестве темы по умолчанию','ru',0),(7170,'Установить тему оформления @theme','ru',0),(7171,'Использовать @theme в качестве темы оформления по умолчанию','ru',0),(7172,'Функция phpinfo() была отключена по соображениям безопасности. Более подробная информация доступна на странице онлайн документации <a href=\":phpinfo\">Включение и отключение phpinfo()</a>.','ru',0),(7173,'Данная версия несовместима с Drupal @core_version и должна быть заменена.','ru',0),(7174,'Данный модуль требует PHP версии @php_required и несовместим с PHP версии @php_version.','ru',0),(7175,'<strong class=\"error\">Чтобы сделать возможными данные оптимизации настройте <a href=\":file-system\">каталог общедоступных файлов</a>.</strong>','ru',0