вки таких писем когда доступны какие-либо обновления. Чтобы получать извещения только для обновлений безопасности, @url.','ru',0),(7199,'Ваш сайт настроен для отправки таких писем когда доступны обновления безопасности. Чтобы получать извещения обо всех обновлениях, @url.','ru',0),(7200,'Ошибка проверки <a href=\":update-report\">доступных обновлений</a> для Drupal.','ru',0),(7201,'Автоматическое обновление ядра Drupal не поддерживается. Информацию про то, как обновлять ядро Drupal вручную смотрите в <a href=\":upgrade-guide\">инструкции по обновлению</a>.','ru',0),(7202,'%archive_file содержит версию %names, которая несовместима с версией Drupal @version.%archive_file содержит версии модулей или тем, которые несовместимы с версией Drupal @version: %names%archive_file содержит версии модулей или тем, которые несовместимы с версией Drupal @version: %names','ru',0),(7203,'Смотрите страницу <a href=\":available_updates\">доступные обновления</a> чтобы получить больше информации и для установки недостающих обновлений.','ru',0),(7204,'Дополнительную информацию смотрите на странице <a href=\":available_updates\">доступных обновлений</a>.','ru',0),(7205,'Настройки менеджера обновлений','ru',0),(7206,'Проверить обновления для неустановленных модулей и тем','ru',0),(7207,'Вы можете найти <a href=\":module_url\">модули</a> и <a href=\":theme_url\">темы</a> на <a href=\":drupal_org_url\">drupal.org</a>. Поддерживаются следующие типы файлов: %extensions.','ru',0),(7208,'Прежде чем начать сделайте резервную копию базы данных и сайта. <a href=\":backup_url\">Узнать как</a>.','ru',0),(7209,'Устарело: Имя пользователя','ru',0),(7210,'Устарело: Используйте account-name или display-name.','ru',0),(7211,'Отображаемое имя учётной записи пользователя.','ru',0),(7212,'Модуль Пользователь(User) позволяет пользователям регистрироваться, входить и выходить с сайта. Кроме того, он дает возможность пользователям с соответствующими правами осуществлять управление  ролями и правами. Дополнительную информацию смотрите в <a href=\":user_docs\">онлайн документации про модуль Пользователь(User)</a>.','ru',0),(7213,'На административной странице <a href=\":people\">Пользователи</a> можно добавлять или удалять учётные записи пользователей, а также назначать пользователям роли. Путём редактирования конкретного пользователя можно изменить его имя пользователя, email-адрес, пароль и информацию в других полях.','ru',0),(7214,'<em>Роли</em> используются с целью группировки и классификации пользователей; каждый пользователь может иметь одну или несколько ролей. Как правило есть две предустановленные роли <em>Анонимный пользователь</em> (для не авторизованных пользователей), и <em>Авторизованный пользователь</em> (пользователи, которые осуществили регистрацию и вход). В зависимости от настроек сайта, может также быть доступна роль <em>Администратор</em>: пользователям с этой ролью каждый раз при включении модуля автоматически предоставляются всевозможные новые права. Также можно создавать дополнительные роли на административной странице <a href=\":roles\">Роли</a>.','ru',0),(7215,'Благодаря тому что Учётные записи пользователей являются типом сущности, вы можете расширять их добавляя поля на вкладке Управление полями на странице <a href=\":accounts\">Настройки учётных записей</a>. С помощью добавления полей, например изображение, биография, или адрес, вы можете создать собственный профиль для пользователей вебсайта. Справочную информацию о сущностях и полях смотрите на странице <a href=\":field_help\">Справка модуля Field</a>.','ru',0),(7216,'Разрешения дают Вам возможность контролирования того, что именно могут видеть и делать пользователи на Вашем сайте. Для каждой роли Вы можете задать необходимое количество разрешений. Смотрите страницу <a href=\":role\">Роли</a> для создания новой роли. Все разрешения, выдаваемые для роли \'Аутентифицированный пользователь\' будут предоставляться любому пользователю, авторизованному на Вашем сайте. На странице <a href=\":settings\">Настроек учётной записи</a> Вы можете задать любую роль в качестве роли администратора сайта, имейте ввиду, что данная роль будет выдавать все новые разрешения автоматически. Вы должны быть аккуратны и уверены в том, что только доверенные пользователи смогут получить такой доступ и уровень контроля на вашем сайте.','ru',0),(7217,'Роли необходимы для объединения пользователей в группы со строго заданными разрешениями. Эти разрешения задаются на странице <a href=\":permissions\">Права доступа</a>. Здесь Вы можете определить названия ролей и их сортировочный порядок на Вашем сайте. Рекомендуется использовать сортировочный порядок ролей при котором сначала идут роли с наименьшими возможностями (например, \'Анонимный пользователь\'), а затем роли с наибольшими возможностями (например, \'Администратор\'). Пользователи, не прошедшие авторизацию на сайте, получат разрешения роли \'Анонимный пользователь\'. Пользователи, прошедшие авторизацию на сайте, получат разрешения роли \'Аутентифицированный пользователь\' и другие роли, назначенные ему в его учётной записи.','ru',0),(7218,'Введите пароль по крайней мере из 12 символов','ru',0),(7219,'Управлять всеми учётными записями пользователей. Включая всю пользовательскую информацию, изменение email адресов и паролей, письма к пользователю, блокирование и удаление учётных записей.','ru',0),(7220,'Требуется, если вы хотите изменить %mail или %pass ниже. <a href=\":request_new_url\" title=\"Отправить инструкцию по сбросу пароля на email.\">Сбросить ваш пароль</a>.','ru',0),(7221,'Пользователи с <a href=\":permissions-url\">правами доступа</a> %select-cancel-method или %administer-users могут переопределить метод по умолчанию.','ru',0),(7222,'Допустимые переменные: [site:name], [site:url], [user:display-name], [user:account-name], [user:mail], [site:login-url], [site:url-brief], [user:edit-url], [user:one-time-login-url], [user:cancel-url].','ru',0),(7223,'Создана новая учётная запись для <a href=\":url\">%name</a>. Email не был отправлен.','ru',0),(7224,'Новый пользователь <a href=\":url\">%name</a> был создан без адреса электронной почты, поэтому приветственное сообщение не было отправлено.','ru',0),(7225,'Приветственный сообщение с дальнейшими инструкциями было отправлено новому пользователю <a href=\":url\">%name</a>.','ru',0),(7226,'Инструкция по сбросу пароля будет отправлена на ваш зарегистрированный email-адрес.','ru',0),(7227,'Отправить инструкции по сбросу пароля на электронную почту.','ru',0),(7228,'Также известен как:','ru',0),(7229,'@label (@name:@column)','ru',0),(7230,'@label:@column','ru',0),(7231,'@label (@name:delta)','ru',0),(7232,'За более подробной информацией обращайтесь к <a href=\":views\">онлайн документации модуля Views</a>.','ru',0),(7233,'Для создания и изменения собственных представлений с помощью административного и конфигурационного пользовательского интерфейса вам необходимо включить или модуль Views UI, который входит в ядро, или контриб модуль, который предоставляет пользовательский интерфейс для представлений. За дополнительной информацией обращайтесь к странице <a href=\":views-ui\">Справка модуля Views UI</a>.','ru',0),(7234,'Эта ссылка предоставлена модулем Views. Путь можно изменить отредактировав представление <a href=\":url\">@label</a>','ru',0),(7235,'@type: язык, выбранный для страницы','ru',0),(7236,'Не будет доступно.','ru',0),(7237,'@code (@title)','ru',0),(7238,'Доступны следующие токены. Также в этом поле можно использовать синтаксис Twig.','ru',0),(7239,'Для данного аргумента действительны следующие токены замены.','ru',0),(7240,'Категория данного блока появится под <a href=\":href\">страницей размещения блоков</a>.','ru',0),(7241,'Разделите несколько классов пробелами.','ru',0),(7242,'Также необходимо откорректировать настройку @settings для текущего выбранного ограничения доступа.','ru',0),(7243,'Также необходимо откорректировать настройку @settings для текущего выбранного механизма кэширования.','ru',0),(7244,'Также необходимо откорректировать настройку @settings для текущего выбранного стиля.','ru',0),(7245,'Также необходимо откорректировать настройку @settings для текущего выбранного стиля строки.','ru',0),(7246,'В данной ссылке доступны следующие токены. Также в данном поле можно использовать синтаксис Twig.','ru',0),(7247,'Также необходимо откорректировать настройку @settings для текущего выбранного страничного навигатора.','ru',0),(7248,'Текст, показываемый данным полем. Можно использовать HTML или <a href=\":url\">Twig</a>. Вы можете ввести данные из текущего представления, как описано в разделе \"Шаблоны замены\" ниже.','ru',0),(7249,'Смещение от текущего времени, например \"@example1\" или \"@example2\"','ru',0),(7250,'Модуль Views UI предоставляет интерфейс для управления отображениями <a href=\":views\">модуля Views</a>. Для получения более подробной информации, смотрите <a href=\":handbook\">онлайн-документацию модуля Views UI</a>.','ru',0),(7251,'Представления могут быть отключены или включены на странице <a href=\":list\">Список представлений</a>. Для того чтобы включить представление, найдите его в списке \"Включены\" и выберите операцию \"Включить\". Чтобы отключить представление, найдите его в списке \"Отключены\" и выберите операцию \"Отключить\".','ru',0),(7252,'Представления могут быть экспортированы и импортированы в файлы настроек с помощью модуля <a href=\":config\">Configuration Manager</a>.','ru',0),(7253,'Расширенные настройки представлений','ru',0),(7254,'Данное представление редактируется другим пользователем @user и поэтому заблокировано для редактирования другими. Эта блокировка длится уже @age. Нажмите здесь, чтобы <a href=\":url\">прервать блокировку</a>.','ru',0),(7255,'Просмотреть @display_title','ru',0),(7256,'Дублировать как @type','ru',0),(7257,'Добавить @display.','ru',0),(7258,'Снятие блокировки приведет к потере всех не сохраненных изменений, сделанных пользователем @user.','ru',0),(7259,'[user:display-name],\r\n\r\nБыл сделан запрос на удаление Вашей учётной записи на сайте [site:name].\r\n\r\nТеперь Вы можете удалить свою учётную запись на сайте [site:url-brief] перейдя по этой ссылке или скопировав ее в адресную строку Вашего браузера:\r\n\r\n[user:cancel-url]\r\n\r\nВНИМАНИЕ: Удаление учётной записи это необратимый процесс!\r\n\r\nСрок действия ссылки завершится через сутки, и если она не будет использована, то удаления не произойдет.\r\n\r\n--  Администрация сайта [site:name]','ru',0),(7260,'Запрос на удаление учётной записи [user:display-name] на сайте «[site:name]»','ru',0),(7261,'Изменение данных для входа пользователя [user:display-name] на сайте «[site:name]»','ru',0),(7262,'Детали учётной записи пользователя [user:display-name] на сайте [site:name]','ru',0),(7263,'[user:display-name],\r\n\r\nБлагодарим вас за регистрацию на сайте «[site:name]». В настоящее время ваша заявка ожидает одобрения администратором. Когда она будет принята, Вы получите другое письмо, в котором будет указано, как войти и установить пароль, а также  прочие детали. \r\n\r\n-- Команда сайта «[site:name]»','ru',0),(7264,'Детали учётной записи [user:display-name] на сайте «[site:name]» (ожидает одобрения администратором)','ru',0),(7265,'[user:display-name] подал заявку на получение учётной записи.\r\n\r\n[user:edit-url]','ru',0),(7266,'[user:display-name],\r\n\r\nВаша учётная запись на сайте «[site:name]» активирована.\r\n\r\nТеперь Вы можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url] \r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу установки пароля.\r\n\r\nПосле установки пароля войти на сайт можно на странице [site:login-url], введя:\r\n\r\nИмя пользователя: [user:account-name]\r\nПароль: ваш пароль \r\n\r\n-- Команда сайта «[site:name]»','ru',0),(7267,'Детали учётной записи [user:display-name] на сайте «[site:name]» (одобрено)','ru',0),(7268,'Детали учётной записи пользователя [user:display-name] на сайте [site:name] (заблокирован)','ru',0),(7269,'[user:display-name],\r\n\r\nВаша учётная запись на сайте «[site:name]» удалена.\r\n\r\n-- Команда сайта «[site:name]»','ru',0),(7270,'Детали учётной записи [user:display-name] на сайте «[site:name]» (удалено)','ru',0),(7271,'Для продолжения установки необходимо выбрать язык.','ru',0),(7272,'@display \'@id\': Компонент \'@name\' был отключен, поскольку эти настройки зависят от удалённых зависимостей.','ru',0),(7273,'Нет доступных виджетов для: %type.','ru',0),(7274,'Допускаются некоторые спецсимволы, среди которых пробел, точка (.), дефис (-), одинарная кавычка (\'), подчёркивание     (_) и знак @.','ru',0),(7275,'Данное значение недопустимо.','ru',0),(7276,'Создать задания, которые может выполнять система.','ru',0),(7277,'URL, на который будет перенаправлен пользователь. Это может быть внутренний URL в виде /node/1234 или внешний URL в виде @url.','ru',0),(7278,'Добавляйте ленты или импортируйте OPML-файлы для сбора внешнего контента и настройте частоту их обновления.','ru',0),(7279,'Модуль \"Автоматизированный Крон\" выполняет операции с помощью обычных запросов браузера / страницы, вместо того, чтобы настраивать отдельную задачу крона. Модуль \"Автоматизированный Крон\" проверяет после каждого ответа сервера, когда выполнялся последний запуск операции, и, если с момента последнего запуска прошло слишком много времени, выполняет задачи после получения ответа сервера. Дополнительную информацию смотрите в <a href=\":automated_cron-documentation\">онлайн-документации о модуле \"Автоматизированный Крон\" (Automated Cron) </a>.','ru',0),(7280,'Настройка модуля Automated Cron','ru',0),(7281,'На странице <a href=\":cron-settings\">Cron</a> можно установить частоту (временной интервал) запуска задач cron.','ru',0),(7282,'Отключение модуля Automated Cron','ru',0),(7283,'Чтобы отключить автоматический запуск cron рекомендуется удалить его модуль, что также позволит уменьшить нагрузку на сайт. Если же требуется отключить его временно, то на странице настроек cron можно установить значение частоты запуска равным \\\"Никогда\\\", а при необходимости вернуть его в исходное значение.','ru',0),(7284,'Автозапуск cron','ru',0),(7285,'Обеспечивает автоматизированный способ запуска задач планировщика cron, выполняя их по завершении ответов сервера.','ru',0),(7286,'Настройки автозапуска cron','ru',0),(7287,'Запрещает посещения с указанных IP-адресов.','ru',0),(7288,'Разместить блок в области можно выбрав <em>Разместить блоки</em> на странице <a href=\":blocks\">Схема блоков</a>. После размещения блока, его можно перенести в другую область с помощью мыши или через выпадающий список <em>Область</em> и затем нажать кнопку <em>Сохранить блоки</em>.','ru',0),(7289,'Расположение блока зависит от конкретной темы на сайте. Изменения будут записаны после нажатия кнопки <em>Сохранить блоки</em> в нижней части страницы.','ru',0),(7290,'Добавление типов комментариев','ru',0),(7291,'Дополнительный <em>тип комментария</em> может быть создан для типа сущности и добавлен на <a href=\":field\">странице типов комментариев</a>. Если на странице типов комментариев доступны несколько типов, вы можете выбрать необходимый вам тип для добавления к нему <em>поля комментария</em>.','ru',0),(7292,'Сравните конфигурацию, загруженную в ваш каталог синхронизации, с активной конфигурацией перед тем как закончить импорт.','ru',0),(7293,'Загрузить архив полной конфигурации в каталог синхронизации.','ru',0),(7294,'Модуль Database Logging записывает системные события в базу данных Drupal. Следите за вашим сайтом или занимайтесь отладкой ошибок сайта на этой странице.','ru',0),(7295,'Модуль Internal Dynamic Page Cache кеширует страницы для всех пользователей в базу данных, обрабатывая корректно динамический контент. Больше информации смотрите на странице <a href=\":dynamic_page_cache-documentation\">Онлайн документация для модуля Internal Dynamic Page Cache</a>','ru',0),(7296,'Модуль не требует настройки. Каждая часть страницы содержит мета-данные, которые позволяют модулю Internal Dynamic Page Cache выяснить, что содержит часть страницы.','ru',0),(7297,'Устарело. Весь функционал был перенесен в ядро.','ru',0),(7298,'Все объекты конфигурации для хранилища полей были повторно сохранены.','ru',0),(7299,'Обработчик выбора для полей ссылок на сущность был успешно откорректирован.','ru',0),(7300,'Включить собственное хранилище','ru',0),(7301,'Тип виджета, зависящий от экземпляра','ru',0),(7302,'Типы виджетов @types использовались в экземплярах полей Drupal 6: тип виджета @selected_type касался основного поля Drupal 8','ru',0),(7303,'Вы можете определить, какие пользователи смогут использовать каждый текстовый формат через выбор ролей. Для обеспечения безопасности, анонимным и ненадёжным пользователям следует иметь доступ к текстовым форматам, которые ограничиваю их чистым текстом или безопасным набором HTML тегов. HTML теги позволяют вкладывать небезопасные ссылки и скрипты в текст. Более надежным зарегистрированным пользователям могут быть назначены права использовать менее ограниченные текстовые форматы для создания форматированного текста. <strong>Неподходящий текстовый формат конфигурации это потенциальная угроза безопасности.</strong>','ru',0),(7304,'Текстовые форматы определяют как будет фильтроваться текст для вывода и как HTML-тэги и другой текст будут показываться, заменяться или удаляться. <strong>Неправильная настройка текстовых форматов может нести угрозу безопасности.</strong> Изучите больше на <a href=\":filter_help\">Странице помощи модуля Фильтр</a>.','ru',0),(7305,'Текстовый формат содержит фильтры, изменяющие отображение введённого пользователем текста, например изымают злонамеренный HTML-код или создают ссылку из URL. Фильтрация осуществляется сверху вниз и последовательность фильтров очень важна, поскольку некий фильтр может помешать работе другого фильтра. Например, когда URL-адреса превращаются в ссылки до удаления неразрешенных HTML-тегов, то это может привести к удалению всех ссылок. Если таковое происходит, последовательность фильтров лучше изменить.','ru',0),(7306,'Настройте фильтрацию содержимого при отображении, включая разрешённые для отображения HTML-тэги, а также включите фильтры, предоставляемые модулями.','ru',0),(7307,'Список HTML-тегов, которые могут быть использованы. По умолчанию для всех HMTL-тегов допустимы только атрибуты <em>lang</em> и <em>dir</em>. Каждый HTML-тег может иметь атрибуты, которые для него являются разрешёнными. Каждый атрибут может принимать любые или только определённые значения. Имена или значения атрибутов могут быть в виде префикса и символа подстановки, например <em>jump-*</em>. Всегда изымаются атрибуты событий JavaScript, URL-адреса JavaScript и CSS.','ru',0),(7308,'Настройка используемых языков для материалов сайта, интерфейса и параметров.','ru',0),(7309,'Перезапись английских строк по умолчанию','ru',0),(7310,'Настроить импорт файлов переводов, и добавить или настроить интерфейс переводов.','ru',0),(7311,'Управление меню и их ссылками.','ru',0),(7312,'<q>Вход</q> для анонимных пользователей','ru',0),(7313,'Вернуть предыдущую редакцию перевода','ru',0),(7314,'Редакции @langname для материала  %title','ru',0),(7315,'Вы действительно желаете вернуть перевод на язык @language к редакции от %revision-date?','ru',0),(7316,'Добавить пользовательские URL-адреса к существующим путям.','ru',0),(7317,'Проблема с сетью!','ru',0),(7318,'- Нет (оригинальное изображение) -','ru',0),(7319,'В результатах поиска появляются только записи из индекса. Для построения и поддержки индекса необходима правильная настройка <a href=\":cron\">задания cron</a>.','ru',0),(7320,'Максимальное количество позиций, индексируемых при каждом запуске <a href=\":cron\">задания cron</a>. При необходимости, чтобы предотвратить возникновение задержек и ошибок памяти во время индексирования, уменьшите это число. Некоторые типы страниц поиска имеют собственные настройки для данного параметра.','ru',0),(7321,'Минимальное количество букв в слове, чтобы оно было проиндексировано. Пои