учётной записи.\r\n\r\nВы можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url] \r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу задания нового пароля. Она действительна в течение суток, и, если по ней не пройти, то ничего не случится.\r\n\r\n-- Команда сайта «[site:name]»','ru',0),(7345,'[user:display-name],\r\n\r\nАдминистратор сайта «[site:name]» создал для вас учётную запись. Вы можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url]\r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу задания своего пароля.\r\n\r\nПосле установки пароля войти на сайт можно на странице [site:login-url], введя:\r\n\r\nИмя пользователя: [user:name]\r\nПароль: ваш пароль \r\n\r\n-- Команда сайта «[site:name]»','ru',0),(7346,'[user:display-name],\r\n\r\nБлагодарим вас за регистрацию на сайте «[site:name]». Можете войти на сайт, щёлкнув по следующей ссылке, или скопировав её в адресную строку браузера:\r\n\r\n[user:one-time-login-url] \r\n\r\nЭта одноразовая ссылка для входа на сайт ведёт на страницу установки пароля.\r\n\r\nПосле установки пароля войти на сайт можно на странице [site:login-url], введя:\r\n\r\nИмя пользователя: [user:name]\r\nПароль: ваш пароль \r\n\r\n-- Команда сайта «[site:name]»','ru',0),(7347,'Код языка.','ru',0),(7348,'Удалить %label','ru',0),(7349,'Разрешить пользователю отображать все элементы','ru',0),(7350,'Для продолжения установки необходимо решить все указанные ниже проблемы. За помощью по настройке сервера базы данных обращайтесь к <a href=\"https://www.drupal.org/getting-started/install\">справочнику по установке</a> или к вашему хостинг-провайдеру.','ru',0),(7351,'Выбор и настройка текстовых редакторов, и фильтров текста для выводы на экран.','ru',0),(7352,'RSS-поток агрегатора','ru',0),(7353,'Источники агрегатора','ru',0),(7354,'Поиск и управление пользовательскими блоками.','ru',0),(7355,'Последние комментарии.','ru',0),(7356,'Поиск файлов и управление ими.','ru',0),(7357,'Редактирование языков','ru',0),(7358,'Все материалы, по месяцам.','ru',0),(7359,'Последние материалы.','ru',0),(7360,'Все материалы, выведенные на главную страницу.','ru',0),(7361,'Все материалы, по алфавиту.','ru',0),(7362,'Материалы, относящиеся к определённому термину таксономии.','ru',0),(7363,'Показывает список новых учётных записей пользователей на сайте.','ru',0),(7364,'Блок «Кто на сайте?»','ru',0),(7365,'Показывает имена пользователей, которые были активными в последнее время, и общее число активных пользователей.','ru',0),(7366,'Страница редактирования представления','ru',0),(7367,'Макс. 1300x1300','ru',0),(7368,'Макс. 2600x2600','ru',0),(7369,'Макс. 325x325','ru',0),(7370,'Макс. 650x650','ru',0),(7371,'Узкий','ru',0),(7372,'Тест перезаписи конфигурации','ru',0),(7373,'Обзор файлов','ru',0),(7374,'Информация про использование файла для {{ arguments.fid }}','ru',0),(7375,'<p>Эта страница предоставляет возможность добавить на сайт общеизвестные языки.</p><p>Если необходимый язык отсутствует, можно добавить собственный язык.</p>','ru',0),(7376,'<p>Выберите язык из списка, или выберите пункт \"Собственный язык...\", который находится в конце списка.</p><p>После выбора языка, нажмите кнопку \"Добавить язык\" .</p><p>При добавлении собственного языка, появится дополнительная форма, где будет необходимо ввести название, код и направление языка.</p>','ru',0),(7377,'Продолжение','ru',0),(7378,'<p>Эта страница предоставляет возможность редактировать язык на вашем сайте, включая собственные языки.</p>','ru',0),(7379,'<p>Невозможно изменить код языка сайта, так как он используется системой для отслеживания языка.</p>','ru',0),(7380,'Название языка используется по всему сайту для всех пользователей и пишется на английском языке. Названия встроенных языков могут быть переведены с помощью модуля Interface Translation, а названия встроенных и собственных языков могут быть переведены с помощью модуля Configuration Translation.','ru',0),(7381,'<p>Выберите направление языка - \"Слева-направо\" или \"Справа-налево\".</p><p>Обратите внимание, что не все темы поддерживают направление \"Справа-налево\", поэтому проверьте свою тему перед использованием направления \"Справа-налево\".</p>','ru',0),(7382,'<p>Страница \"Языки\" позволяет вам добавлять, редактировать, удалять, и упорядочивать языки для сайта.</p>','ru',0),(7383,'<p>Для добавления языков на ваш сайт, нажмите кнопку \"Добавить язык\".</p><p>Добавленные языки будут отображаться в списке языков и потом могут быть отредактированы или удалены.</p>','ru',0),(7384,'Переупорядочивание языков','ru',0),(7385,'<p>Чтобы изменить порядок языков на сайте, используйте иконки перемещения рядом с каждым языком.</p><p>В указанной здесь последовательности языки будут отображаться в списках языков на сайте, например в блоках переключения языков, которые предоставляются модулями Перевод Интерфейса и Перевод Материалов.</p><p>После окончания изменения порядка языков, нажмите на кнопку \"Сохранить конфигурацию\" чтобы изменения вступили в силу.</p>','ru',0),(7386,'Установить языком по умолчанию','ru',0),(7387,'<p>Вы можете выбрать язык сайта по умолчанию, выбрав один из настроенных языков языком по умолчанию. Сайт будет использовать язык по умолчанию в ситуациях, когда выбор не сделан, но язык должен быть установлен, например язык отображаемого интерфейса.</p>','ru',0),(7388,'Изменение языков','ru',0),(7389,'<p>Операции предназначенные для редактирования и удаления ваших языков.</p><p>Вы можете отредактировать имя и направление языка.</p><p>Удалённые языки можно вернуть обратно позже. Удаление языка удалит все переводы интерфейса связанные с ним, и для всех материалов на этом языке будет установлен нейтральный язык. Обратите внимание, что вы не можете удалить язык установленный по умолчанию для сайта.</p>','ru',0),(7390,'Выберите язык, который вы хотите перевести.','ru',0),(7391,'Введите опредёленное слово или предложение, которое необходимо перевести. Можно ввести только часть слова.','ru',0),(7392,'Фильтрация результатов поиска','ru',0),(7393,'Вы можете искать непереведённые строки, если вы хотите перевести что-нибудь ещё непереведённое. Если вы хотите изменить существующий перевод, вы можете искать только переведённые строки.','ru',0),(7394,'Применить критерий поиска','ru',0),(7395,'Для применения выбранного критерия поиска, нажмите кнопку <em>Фильтр</em>.','ru',0),(7396,'Вы можете написать свой собственный вариант перевода в текстовых полях правой колонки. Попробуйте выяснить, в каком контексте будет использоваться текст для того, чтобы перевести его как можно точнее.','ru',0),(7397,'Подтверждение перевода','ru',0),(7398,'После завершения ваших переводов нажмите кнопку <em>Сохранить переводы</em>. Необходимо сохранять переводы каждый раз перед изменением страницы или выполнением нового поиска.','ru',0),(7399,'{{ arguments.created_year_month }}','ru',0),(7400,'Поиск материалов и управление ими','ru',0),(7401,'{{ arguments.tid }}','ru',0),(7402,'Имя или email содержит','ru',0),(7403,'Список новых пользователей','ru',0),(7404,'В данный момент пользователей онлайн: @total.','ru',0),(7405,'Сейчас 0 пользователей онлайн.','ru',0),(7406,'Список пользователей, авторизированных в данный момент.','ru',0),(7407,'Управление настройками представления','ru',0),(7408,'Просмотр или редактирование конфигурации.','ru',0),(7409,'Отображения в этом представлении','ru',0),(7410,'Отображение - это способ вывода результатов, например, в виде страницы или блока. Представление может содержать несколько отображений, которые перечислены здесь. Активное отображение подсвечено.','ru',0),(7411,'Администрирование представления','ru',0),(7412,'Выполнение административных задач, включающие добавление описания и создание копии. Нажмите раскрывающуюся кнопку для просмотра доступных действий.','ru',0),(7413,'Выберите способ вывода результатов. Например, выберите <em>Содержимое</em>, для вывод